('1b60b46c-a210-11f0-9791-b274a840afec', NULL, 'UPDATE_INDICATOR', 'indicators', '06f499b3-0ec8-4e8c-9309-04937287e493', NULL, '{\"indicator_name\":\"Indeks Ketimpangan Gender\",\"changes\":{\"code\":\"IKG02\",\"no\":1,\"indikator\":\"Indeks Ketimpangan Gender\",\"kategori\":\"Statistik Lingkungan Hidup & Multi-Domain\",\"subcategory\":\"Gender\",\"satuan\":\"Persen\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"Indeks Ketimpangan Gender merupakan salah satu indikator penting dalam kategori Gender untuk Kabupaten Bungo.\",\"category_id\":\"\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Konsep ini mengacu pada definisi standar BPS yang telah disesuaikan dengan kondisi lokal Kabupaten Bungo. Indikator ini mengukur aspek fundamental dari pembangunan daerah.\",\"metode_perhitungan\":\"Data dikumpulkan melalui survei penduduk dan registrasi administrasi kependudukan dengan menggunakan metodologi standar BPS yang telah disesuaikan dengan karakteristik wilayah.\",\"interpretasi\":\"Interpretasi: Indeks Ketimpangan Gender pada periode terkini menunjukkan tren positif. Nilai ini mencerminkan kondisi yang baik dalam kategori Gender di Kabupaten Bungo. Peningkatan dari periode sebelumnya menunjukkan adanya perbaikan yang konsisten.\"}}', '', '', '2025-10-05 17:24:11'),
