('32787154-a4bc-11f0-b0b6-b274a840afeb', NULL, 'UPDATE_INDICATOR', 'indicators', 'ef4991fb-f4ec-43e1-8233-e73774b15e75', NULL, '{\"indicator_name\":\"Garis Kemiskinan\",\"changes\":{\"code\":\"Poor01\",\"no\":1,\"indikator\":\"Garis Kemiskinan\",\"kategori\":\"Statistik Demografi & Sosial\",\"subcategory\":\"Kemiskinan\",\"satuan\":\"Rp/bulan/Kapita\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"Garis kemiskinan merupakan batas nilai pengeluaran minimum per kapita per bulan yang diperlukan untuk memenuhi kebutuhan dasar makanan dan nonmakanan.\",\"category_id\":\"\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Garis kemiskinan adalah nilai pengeluaran minimum yang diperlukan seseorang untuk memenuhi kebutuhan dasar hidup layak, meliputi kebutuhan makanan yang setara dengan 2.100 kalori per kapita per hari dan kebutuhan nonmakanan seperti perumahan, pendidikan, serta kesehatan.\",\"metode_perhitungan\":\"Metode perhitungannya dilakukan dengan menjumlahkan Garis Kemiskinan Makanan (GKM) dan Garis Kemiskinan Nonmakanan (GKNM), yang diperoleh dari hasil Survei Sosial Ekonomi Nasional (Susenas).\",\"interpretasi\":\"Penduduk dengan pengeluaran per kapita per bulan di bawah garis kemiskinan dikategorikan sebagai penduduk miskin. Kenaikan garis kemiskinan menunjukkan meningkatnya biaya kebutuhan dasar di wilayah tersebut.\"}}', '', '', '2025-10-09 03:01:05'),
