('29e2ecb4-0805-4687-84a5-cbaf6b83516f', 'Test Article by admin_lingkungan - 1759909153262', 'This is a test article created by admin_lingkungan with category lingkungan', 'Test Author admin_lingkungan', '5 menit', '[\"test\",\"lingkungan\"]', 'lingkungan', NULL, NULL, 0, NULL, NULL, 0, '2025-10-08 07:39:13', '2025-10-08 07:39:13'),
('2c32c371-fe0c-44af-baa6-9a08bf6fe811', 'Gender Parity Index: Mengukur Kesetaraan Gender dalam Pendidikan', 'Gender Parity Index (GPI) atau Indeks Paritas Gender adalah indikator yang mengukur tingkat kesetaraan antara laki-laki dan perempuan dalam berbagai aspek, terutama pendidikan. Indikator ini penting untuk memantau pencapaian kesetaraan gender dalam pembangunan.', 'Tim Statistik BPS Bungo', '7 menit', '[\"Gender\",\"Pendidikan\",\"Kesetaraan\"]', 'lingkungan', NULL, NULL, 1, '2025-10-08 03:30:12', NULL, 0, '2025-10-08 02:43:33', '2025-10-08 03:30:12'),
('34a47ede-425c-459a-a52b-8782b90de5d5', 'Inflasi Kabupaten Bungo: Penyebab dan Dampaknya terhadap Masyarakat', 'Inflasi merupakan kenaikan harga barang dan jasa secara umum dan terus menerus dalam suatu periode tertentu. Pemahaman tentang inflasi penting bagi masyarakat untuk mengantisipasi dampaknya terhadap daya beli dan perencanaan keuangan.', 'Tim Statistik Produksi', '6 menit', '[\"Inflasi\",\"Harga\",\"Ekonomi\"]', 'ekonomi', NULL, NULL, 0, NULL, NULL, 0, '2025-10-08 02:55:56', '2025-10-08 07:38:40'),
('aa5705cf-4a80-40e5-8b12-761a793074c4', 'mahfud md', 'asdgeyrnsndnddfd;lkgdfjglkfdgkldflkghlfnhtjhlkfglklkfmlkdmgflmlndnfgmh,gdfmnhggfnlkhndfglhnldfghlgfjlhjglkhjlkgfjhlkfjglkhjglkfjlkdflkjlkfjdlkjflkgjdlkfjglkjflkjlgkfjlgfjlkjgfljlfjlfjglkjhlkgjfllhlf', 'tim mahfud', '10 menit', '[\"agama\",\"sosial\"]', 'lingkungan', NULL, NULL, 1, '2025-10-08 07:26:09', NULL, 0, '2025-10-08 07:23:53', '2025-10-08 07:26:09'),
('b7f8b55e-d40a-4690-91b7-03d651d06e0c', 'Memahami Indeks Pembangunan Manusia (IPM) Kabupaten Bungo', 'Indeks Pembangunan Manusia (IPM) merupakan indikator komposit yang mengukur pencapaian rata-rata suatu negara atau daerah dalam tiga dimensi dasar pembangunan manusia: umur panjang dan hidup sehat, pengetahuan, dan standar hidup layak. Di Kabupaten Bungo, IPM menjadi salah satu indikator utama untuk mengukur keberhasilan pembangunan daerah.', 'BPS Bungo', '8 menit', '[\"IPM\",\"Pembangunan\",\"Sosial\"]', 'demografi', NULL, NULL, 1, '2025-10-08 03:39:57', NULL, 0, '2025-10-08 02:46:48', '2025-10-08 06:47:16'),
('c7afef83-db2d-4818-9fb5-25e0f87ef8dd', 'Test Article by admin_ekonomi - 1759909153155', 'This is a test article created by admin_ekonomi with category ekonomi', 'Test Author admin_ekonomi', '5 menit', '[\"test\",\"ekonomi\"]', 'ekonomi', NULL, NULL, 0, NULL, NULL, 0, '2025-10-08 07:39:13', '2025-10-08 07:39:13'),
('ccb29b1f-caa1-48ed-b34a-12603faf0031', 'Analisis Pertumbuhan Ekonomi Kabupaten Bungo: Tren dan Proyeksi', 'Produk Domestik Regional Bruto (PDRB) merupakan indikator utama untuk mengukur kinerja ekonomi suatu daerah. Analisis pertumbuhan ekonomi Kabupaten Bungo menunjukkan dinamika yang menarik dengan berbagai faktor pendorong dan penghambat.', 'Tim Statistik Ekonomi', '12 menit', '[\"PDRB\",\"Ekonomi\",\"Pertumbuhan\"]', 'ekonomi', NULL, NULL, 1, '2025-10-08 03:29:26', NULL, 0, '2025-10-08 02:53:46', '2025-10-08 03:29:26'),
('ce79d86e-6181-4f2b-8a32-0ff706dcb04e', 'Test CREATE by admin_lingkungan - 1759909295999', 'Test content for lingkungan category', 'Test Author admin_lingkungan', '5 menit', '[\"test\",\"lingkungan\"]', 'lingkungan', NULL, NULL, 0, NULL, NULL, 0, '2025-10-08 07:41:36', '2025-10-08 07:41:36'),
('e76bb1e7-a060-4a63-8c2e-55f6eabc65c1', 'Test CREATE by admin_ekonomi - 1759909295791', 'Test content for ekonomi category', 'Test Author admin_ekonomi', '5 menit', '[\"test\",\"ekonomi\"]', 'ekonomi', NULL, NULL, 1, '2025-10-10 03:10:31', NULL, 0, '2025-10-08 07:41:35', '2025-10-10 03:10:31'),
('ec6a72f8-5d22-4d53-b411-dc4b9bcfdd74', 'Metodologi Survei Angkatan Kerja Nasional (SAKERNAS)', 'Survei Angkatan Kerja Nasional (SAKERNAS) adalah survei yang dilakukan BPS untuk mengumpulkan data ketenagakerjaan di Indonesia. Survei ini menjadi sumber data utama untuk menghitung indikator ketenagakerjaan seperti Tingkat Pengangguran Terbuka (TPT) dan Tingkat Partisipasi Angkatan Kerja (TPAK).', 'Tim Statistik Sosial', '15 menit', '[\"SAKERNAS\",\"Ketenagakerjaan\",\"Metodologi\"]', 'demografi', NULL, NULL, 1, '2025-10-08 03:30:44', NULL, 0, '2025-10-08 02:51:06', '2025-10-08 03:30:44'),
('f2de0886-06fe-4666-885f-35b61afff519', 'Indikator Lingkungan Hidup: Mengukur Keberlanjutan Pembangunan', 'Indikator lingkungan hidup merupakan alat ukur untuk menilai kondisi dan kualitas lingkungan serta dampak aktivitas manusia terhadap ekosistem. Di era pembangunan berkelanjutan, indikator ini menjadi semakin penting untuk memastikan keseimbangan antara pertumbuhan ekonomi dan kelestarian lingkungan.', 'Statistik Lingkungan & Multidomain', '10 menit', '[\"Lingkungan\",\"Berkelanjutan\",\"Indikator\"]', 'lingkungan', NULL, NULL, 1, '2025-10-08 03:30:15', NULL, 0, '2025-10-08 02:41:28', '2025-10-08 03:30:15'),
('f5e438ac-4bec-4575-902b-9791530675db', 'Test CREATE by admin_demografi - 1759909295571', 'Test content for demografi category', 'Test Author admin_demografi', '5 menit', '[\"test\",\"demografi\"]', 'demografi', NULL, NULL, 0, NULL, NULL, 0, '2025-10-08 07:41:35', '2025-10-08 07:41:35');
INSERT INTO `article_sections` (`id`, `article_id`, `title`, `content`, `order_number`, `created_at`, `updated_at`) VALUES
('012e9df1-bcb5-4f96-b89b-630fec2af756', '2c32c371-fe0c-44af-baa6-9a08bf6fe811', 'Cara Menghitung GPI', 'GPI dihitung dengan membagi angka partisipasi sekolah perempuan dengan angka partisipasi sekolah laki-laki. Nilai GPI = 1 menunjukkan kesetaraan sempurna, < 1 menunjukkan disparitas merugikan perempuan, dan > 1 menunjukkan disparitas merugikan laki-laki.', 1, '2025-10-08 03:30:12', '2025-10-08 03:30:12'),
('240a735a-28e5-4cd0-9666-63915da03392', '2c32c371-fe0c-44af-baa6-9a08bf6fe811', 'Implikasi Kebijakan', 'Data GPI digunakan untuk merancang program pendidikan yang responsif gender, mengidentifikasi kelompok yang memerlukan perhatian khusus, dan memantau progress pencapaian SDGs terkait kesetaraan gender.', 3, '2025-10-08 03:30:12', '2025-10-08 03:30:12'),
('3d5da3a7-e517-4779-8d91-fecc53f74033', 'ccb29b1f-caa1-48ed-b34a-12603faf0031', 'Tren Pertumbuhan PDRB', 'PDRB Kabupaten Bungo mengalami pertumbuhan rata-rata 4.2% dalam lima tahun terakhir. Sektor pertanian, kehutanan, dan perikanan masih menjadi kontributor terbesar dengan pangsa sekitar 35% dari total PDRB.', 1, '2025-10-08 03:29:26', '2025-10-08 03:29:26'),
('3f3de0b0-e2a3-4c1d-9eb2-673ceeca1baa', '34a47ede-425c-459a-a52b-8782b90de5d5', 'Dampak terhadap Masyarakat', 'Inflasi berdampak pada menurunnya daya beli masyarakat, terutama kelompok berpenghasilan rendah. Namun, inflasi yang terkendali juga dapat mendorong pertumbuhan ekonomi dan investasi.', 2, '2025-10-08 07:38:40', '2025-10-08 07:38:40'),
('46d41c56-dc91-4421-b480-afe2afa65c92', '2c32c371-fe0c-44af-baa6-9a08bf6fe811', 'GPI di Kabupaten Bungo', 'GPI untuk pendidikan dasar di Kabupaten Bungo mencapai 0.98, menunjukkan kesetaraan yang hampir sempurna. Untuk pendidikan menengah, GPI mencapai 1.05, menunjukkan partisipasi perempuan yang sedikit lebih tinggi.', 2, '2025-10-08 03:30:12', '2025-10-08 03:30:12'),
('48070904-ec3f-4d90-abef-6a55dfee13fb', 'ec6a72f8-5d22-4d53-b411-dc4b9bcfdd74', 'Desain Survei', 'SAKERNAS menggunakan desain survei rumah tangga dengan metode sampling probabilitas. Survei dilakukan dua kali dalam setahun (Februari dan Agustus) dengan cakupan seluruh wilayah Indonesia termasuk Kabupaten Bungo.', 1, '2025-10-08 03:30:44', '2025-10-08 03:30:44'),
('4cc42328-543e-4f18-aff2-665923b45e10', 'ec6a72f8-5d22-4d53-b411-dc4b9bcfdd74', 'Penggunaan Data', 'Data SAKERNAS digunakan untuk perencanaan program ketenagakerjaan, evaluasi kebijakan pasar kerja, dan monitoring pencapaian target pembangunan berkelanjutan (SDGs) terkait pekerjaan layak.', 3, '2025-10-08 03:30:44', '2025-10-08 03:30:44'),
('74016ad4-8885-45b9-86b4-67968d484819', 'f2de0886-06fe-4666-885f-35b61afff519', 'Kondisi Lingkungan Kabupaten Bungo', 'Kabupaten Bungo memiliki tutupan hutan yang masih cukup baik dengan persentase sekitar 60% dari total luas wilayah. Kualitas air sungai utama masih dalam kategori baik, namun perlu pemantauan berkelanjutan.', 2, '2025-10-08 03:30:15', '2025-10-08 03:30:15'),
('837f8fdd-51a1-4bbf-8ac3-ac8184bb0d9c', 'ccb29b1f-caa1-48ed-b34a-12603faf0031', 'Proyeksi dan Tantangan', 'Proyeksi pertumbuhan ekonomi diperkirakan akan tetap stabil dengan tantangan utama berupa diversifikasi ekonomi, peningkatan nilai tambah produk lokal, dan pengembangan sumber daya manusia.', 3, '2025-10-08 03:29:26', '2025-10-08 03:29:26'),
('8f5efdb3-17fe-49ab-a8b9-260d7d054ea0', 'b7f8b55e-d40a-4690-91b7-03d651d06e0c', 'IPM Kabupaten Bungo', 'Berdasarkan data terbaru, IPM Kabupaten Bungo mencapai 69.85 pada tahun 2024, mengalami peningkatan dari tahun sebelumnya. Capaian ini menempatkan Kabupaten Bungo dalam kategori sedang menurut klasifikasi UNDP.', 2, '2025-10-08 03:39:57', '2025-10-08 03:39:57'),
('9c0cfe1b-3f95-42f1-9ea0-2ad6e22bd128', 'b7f8b55e-d40a-4690-91b7-03d651d06e0c', 'Komponen IPM', 'IPM terdiri dari tiga dimensi utama: (1) Umur Panjang dan Hidup Sehat yang diukur dengan Angka Harapan Hidup saat lahir, (2) Pengetahuan yang diukur dengan Harapan Lama Sekolah dan Rata-rata Lama Sekolah, dan (3) Standar Hidup Layak yang diukur dengan Pengeluaran per kapita yang disesuaikan.', 1, '2025-10-08 03:39:57', '2025-10-08 03:39:57'),
('a8d57b2b-1d03-4a61-8d2d-299bb9cd1c1d', 'ec6a72f8-5d22-4d53-b411-dc4b9bcfdd74', 'Konsep dan Definisi', 'Angkatan kerja adalah penduduk usia kerja (15 tahun ke atas) yang bekerja atau sedang mencari pekerjaan. TPT adalah persentase pengangguran terhadap angkatan kerja, sedangkan TPAK adalah persentase angkatan kerja terhadap penduduk usia kerja.', 2, '2025-10-08 03:30:44', '2025-10-08 03:30:44'),
('b7958283-3606-4545-93b0-14d5164bf696', '34a47ede-425c-459a-a52b-8782b90de5d5', 'Strategi Mitigasi', 'Pemerintah daerah dapat melakukan stabilisasi harga melalui operasi pasar, perbaikan infrastruktur distribusi, dan koordinasi dengan pemerintah pusat dalam kebijakan moneter dan fiskal.', 3, '2025-10-08 07:38:40', '2025-10-08 07:38:40'),
('bdedf282-20dc-467c-9d5d-2941b19ab73f', '34a47ede-425c-459a-a52b-8782b90de5d5', 'Penyebab Inflasi di Kabupaten Bungo', 'Inflasi di Kabupaten Bungo dipengaruhi oleh faktor eksternal seperti kenaikan harga BBM dan faktor internal seperti gangguan distribusi, cuaca ekstrem yang mempengaruhi produksi pertanian, dan peningkatan permintaan pada periode tertentu.', 1, '2025-10-08 07:38:40', '2025-10-08 07:38:40'),
('c0dbf0d6-6ca9-4b26-bbc2-db753ae163a0', 'b7f8b55e-d40a-4690-91b7-03d651d06e0c', 'Interpretasi dan Manfaat', 'IPM yang meningkat menunjukkan adanya perbaikan kualitas hidup masyarakat. Data IPM dapat digunakan untuk evaluasi program pembangunan, perencanaan kebijakan, dan perbandingan antar wilayah.', 3, '2025-10-08 03:39:57', '2025-10-08 03:39:57'),
('c8001ab4-b8b5-41d4-bc77-7427933b7089', 'f2de0886-06fe-4666-885f-35b61afff519', 'Jenis Indikator Lingkungan', 'Indikator lingkungan meliputi kualitas air, udara, tutupan lahan, keanekaragaman hayati, dan pengelolaan limbah. Setiap indikator memiliki parameter dan standar tertentu yang harus dipantau secara berkala.', 1, '2025-10-08 03:30:15', '2025-10-08 03:30:15'),
('dc567328-82b3-4e4a-9480-75b767f896b3', 'f5e438ac-4bec-4575-902b-9791530675db', 'Section 1', 'Test section content', 1, '2025-10-08 07:41:35', '2025-10-08 07:41:35'),
('e17fdcd9-f5a1-4433-b3d8-03340bc4d4a8', 'f2de0886-06fe-4666-885f-35b61afff519', 'Tantangan dan Upaya Konservasi', 'Tantangan utama adalah tekanan pembangunan terhadap lahan hutan dan pencemaran dari aktivitas industri. Upaya konservasi dilakukan melalui program rehabilitasi hutan, pengelolaan sampah terpadu, dan edukasi masyarakat.', 3, '2025-10-08 03:30:15', '2025-10-08 03:30:15'),
