('01bbe08c-a4bc-11f0-b0b6-b274a840afeb', 'indicators', 'ef4991fb-f4ec-43e1-8233-e73774b15e75', 'CREATE', NULL, '{\"code\": \"Poor01\", \"indikator\": \"Garis Kemiskinan\", \"kategori\": \"Statistik Demografi & Sosial\", \"subcategory\": \"Kemiskinan\", \"satuan\": \"Rp/bulan/Kapita\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 02:59:43'),
('024ee958-c555-4a74-a04d-46066a4fb380', 'indicators', 'f115a13a-5e70-4479-8e4f-1a35471453e6', 'CREATE', NULL, '{\"code\":\"Poor03\",\"no\":1,\"indikator\":\"Tingkat Kemiskinan (P0)\",\"kategori\":\"Statistik Demografi & Sosial\",\"subcategory\":\"Kemiskinan\",\"satuan\":\"Persen\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"Tingkat kemiskinan (P0) merupakan persentase jumlah penduduk yang berada di bawah garis kemiskinan terhadap total penduduk.\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Tingkat kemiskinan atau headcount index (P0) adalah proporsi penduduk yang memiliki pengeluaran per kapita di bawah garis kemiskinan dibandingkan dengan total penduduk.\",\"metode_perhitungan\":\"Metode perhitungannya dilakukan dengan membagi jumlah penduduk miskin dengan total penduduk, kemudian dikalikan 100 persen.\",\"interpretasi\":\"Tingkat kemiskinan menunjukkan seberapa besar proporsi penduduk miskin dalam populasi. Nilai yang lebih rendah menandakan peningkatan kesejahteraan masyarakat.\",\"created_by\":\"a8bbbd66-9f81-11f0-a168-b274a840afeb\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 03:02:13'),
('03620f86-a4b9-11f0-b0b6-b274a840afeb', 'indicators', '980ed2a0-6b68-41ae-9b20-659d6baa0d94', 'CREATE', NULL, '{\"code\": \"Perkapita02\", \"indikator\": \"PDRB per Kapita per Tahun ADHK\", \"kategori\": \"Statistik Ekonomi\", \"subcategory\": \"PDRB PerKapita\", \"satuan\": \"Juta Rupiah\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 02:38:18'),
('04458a4d-1c82-4ce4-b073-cbfa90800fb6', 'indicators', '518770e0-bdf7-419a-9364-e3c825a755c6', 'CREATE', NULL, '{\"code\":\"PE\",\"no\":1,\"indikator\":\"Pertumbuhan Ekonomi\",\"kategori\":\"Statistik Ekonomi\",\"subcategory\":\"PDRB\",\"satuan\":\"Persen\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"Pertumbuhan ekonomi merupakan persentase perubahan nilai PDRB ADHK dari satu tahun ke tahun berikutnya yang menggambarkan laju peningkatan aktivitas ekonomi riil di suatu wilayah.\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Pertumbuhan ekonomi adalah tingkat perubahan PDRB Atas Dasar Harga Konstan (ADHK) dari tahun ke tahun yang menunjukkan sejauh mana output barang dan jasa suatu wilayah meningkat secara riil tanpa dipengaruhi oleh perubahan harga.\",\"metode_perhitungan\":\"Pertumbuhan ekonomi dihitung dengan rumus:\\nPE = ((PDRB ADHK_t  - PDRB ADHK_t-1)/PDRB ADHK_t-1)x100%\\ndi mana  t adalah tahun berjalan dan  t1 adalah tahun sebelumnya.\",\"interpretasi\":\"Nilai pertumbuhan ekonomi yang positif menunjukkan peningkatan produksi dan aktivitas ekonomi di wilayah tersebut, sedangkan nilai negatif menunjukkan adanya penurunan kinerja ekonomi dibandingkan tahun sebelumnya.\",\"created_by\":\"51670c9e-9f83-11f0-a168-b274a840afeb\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 02:35:25'),
('0486505c-a586-11f0-b0b6-b274a840afeb', 'indicators', '280c20e4-d6e3-46e8-ba24-d62020b95914', 'UPDATE', '{\"code\": \"INFLASI_YOY\", \"indikator\": \"Inflasi\", \"kategori\": \"Statistik Ekonomi\", \"subcategory\": \"Inflasi\", \"satuan\": \"Persen (%)\"}', '{\"code\": \"INFLASI_YOY\", \"indikator\": \"Inflasi\", \"kategori\": \"Statistik Ekonomi\", \"subcategory\": \"Inflasi\", \"satuan\": \"Persen (%)\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-10 03:05:46'),
