('138308b1-a2d2-4d41-9502-434c70fafa49', 'indicators', '980ed2a0-6b68-41ae-9b20-659d6baa0d94', 'CREATE', NULL, '{\"code\":\"Perkapita02\",\"no\":1,\"indikator\":\"PDRB per Kapita per Tahun ADHK\",\"kategori\":\"Statistik Ekonomi\",\"subcategory\":\"PDRB PerKapita\",\"satuan\":\"Juta Rupiah\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"PDRB per Kapita per Tahun ADHK merupakan nilai rata-rata PDRB Atas Dasar Harga Konstan yang diterima setiap penduduk dalam satu tahun berdasarkan harga pada tahun dasar, sehingga mencerminkan kesejahteraan riil masyarakat tanpa pengaruh inflasi.\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"PDRB per Kapita ADHK adalah nilai Produk Domestik Regional Bruto Atas Dasar Harga Konstan yang dibagi dengan jumlah penduduk pada tahun yang sama, dihitung menggunakan harga tahun dasar tertentu (misalnya tahun 2010 atau 2015) untuk menggambarkan pendapatan riil per kapita tanpa memperhitungkan perubahan harga.\",\"metode_perhitungan\":\"PDRBperKapitaADHK=PDRBADHK/JumlahPenduduk\",\"interpretasi\":\"PDRB per Kapita ADHK mencerminkan perubahan kesejahteraan ekonomi masyarakat secara riil. Kenaikan indikator ini menunjukkan adanya peningkatan pendapatan riil per penduduk di wilayah tersebut dari waktu ke waktu.\",\"created_by\":\"51670c9e-9f83-11f0-a168-b274a840afeb\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 02:38:18'),
