('258333f7-40ab-4205-ae05-d2cc7ef7d52c', 'indicators', '61ba184d-be21-44cf-b005-9d21e3fa62ad', 'CREATE', NULL, '{\"code\":\"IPM-SP2010\",\"no\":1,\"indikator\":\"IPM SP2010\",\"kategori\":\"Statistik Lingkungan Hidup & Multi-Domain\",\"subcategory\":\"Indeks Pembangunan\",\"satuan\":\"Persen\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"IPM SP2010 merupakan salah satu indikator penting dalam kategori Indeks Pembangunan untuk Kabupaten Bungo.\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Konsep ini mengacu pada definisi standar BPS yang telah disesuaikan dengan kondisi lokal Kabupaten Bungo. Indikator ini mengukur aspek fundamental dari pembangunan daerah.\",\"metode_perhitungan\":\"Data dikumpulkan melalui survei penduduk dan registrasi administrasi kependudukan dengan menggunakan metodologi standar BPS yang telah disesuaikan dengan karakteristik wilayah.\",\"interpretasi\":\"Interpretasi: IPM SP2010 pada periode terkini menunjukkan tren positif. Nilai ini mencerminkan kondisi yang baik dalam kategori Indeks Pembangunan di Kabupaten Bungo. Peningkatan dari periode sebelumnya menunjukkan adanya perbaikan yang konsisten.\",\"created_by\":\"40574dca-9f87-11f0-a168-b274a840afeb\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-05 14:10:58'),
