('2888caaf-a609-4c9a-8070-8fd680f9306e', 'indicators', 'eb8442fe-13c2-483f-b941-cf7f72871deb', 'CREATE', NULL, '{\"code\":\"Labour02\",\"no\":1,\"indikator\":\"Jumlah Penduduk Bekerja\",\"kategori\":\"Statistik Demografi & Sosial\",\"subcategory\":\"Ketenagakerjaan\",\"satuan\":\"Jiwa\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"Jumlah penduduk bekerja merupakan total penduduk usia kerja yang melakukan kegiatan ekonomi untuk memperoleh pendapatan atau keuntungan selama periode tertentu.\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Jumlah penduduk bekerja adalah banyaknya penduduk berusia 15 tahun ke atas yang melakukan pekerjaan minimal satu jam dalam seminggu terakhir untuk memperoleh penghasilan, baik sebagai pekerja penuh, pekerja keluarga, maupun pekerja bebas.\",\"metode_perhitungan\":\"Metode perhitungannya didasarkan pada hasil Survei Angkatan Kerja Nasional (SAKERNAS) dengan menghitung seluruh individu usia kerja yang tergolong bekerja sesuai kriteria BPS.\",\"interpretasi\":\"umlah penduduk bekerja mencerminkan tingkat penyerapan tenaga kerja di suatu wilayah. Peningkatan jumlah penduduk bekerja menunjukkan kondisi pasar tenaga kerja yang semakin baik dan produktif.\",\"created_by\":\"a8bbbd66-9f81-11f0-a168-b274a840afeb\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 02:54:04'),
