('3743e72b-77e3-4ea0-9b2c-163347e95ada', 'indicators', 'ef4991fb-f4ec-43e1-8233-e73774b15e75', 'CREATE', NULL, '{\"code\":\"Poor01\",\"no\":1,\"indikator\":\"Garis Kemiskinan\",\"kategori\":\"Statistik Demografi & Sosial\",\"subcategory\":\"Kemiskinan\",\"satuan\":\"Rp/bulan/Kapita\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"Garis kemiskinan merupakan batas nilai pengeluaran minimum per kapita per bulan yang diperlukan untuk memenuhi kebutuhan dasar makanan dan nonmakanan.\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Garis kemiskinan adalah nilai pengeluaran minimum yang diperlukan seseorang untuk memenuhi kebutuhan dasar hidup layak, meliputi kebutuhan makanan yang setara dengan 2.100 kalori per kapita per hari dan kebutuhan nonmakanan seperti perumahan, pendidikan, serta kesehatan.\",\"metode_perhitungan\":\"Metode perhitungannya dilakukan dengan menjumlahkan Garis Kemiskinan Makanan (GKM) dan Garis Kemiskinan Nonmakanan (GKNM), yang diperoleh dari hasil Survei Sosial Ekonomi Nasional (Susenas).\",\"interpretasi\":\"Semakin mendekati 0 nilai Gini Rasio, semakin merata distribusi pendapatan masyarakat; sebaliknya, semakin mendekati 1, semakin tinggi tingkat ketimpangan ekonomi di wilayah tersebut.\",\"created_by\":\"a8bbbd66-9f81-11f0-a168-b274a840afeb\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 02:59:43'),
