('39a92223-4527-4ed9-9115-bbcd1f10e3c7', 'indicators', 'ac35d74c-d7ab-4062-8dfa-af15e158930c', 'UPDATE', '[{\"id\":\"ac35d74c-d7ab-4062-8dfa-af15e158930c\",\"code\":\"PDRB-ADHK\",\"no\":1,\"indikator\":\"PDRB ADHK\",\"kategori\":\"Statistik Ekonomi\",\"subcategory\":\"PDRB\",\"satuan\":\"Juta Rupiah\",\"source\":null,\"methodology\":null,\"deskripsi\":\"PDRB ADHK merupakan nilai total barang dan jasa yang dihasilkan suatu wilayah pada tahun berjalan berdasarkan harga tahun dasar sehingga mencerminkan pertumbuhan ekonomi riil tanpa pengaruh inflasi.\",\"is_active\":0,\"created_by\":\"51670c9e-9f83-11f0-a168-b274a840afeb\",\"category_id\":null,\"created_at\":\"2025-10-09T02:32:38.000Z\",\"updated_at\":\"2025-10-09T03:08:38.000Z\"}]', '{\"is_active\":true}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 07:07:20'),
('3a007c20-ae42-47e6-a004-893b7b2c007f', 'indicators', '518770e0-bdf7-419a-9364-e3c825a755c6', 'UPDATE', '[{\"id\":\"518770e0-bdf7-419a-9364-e3c825a755c6\",\"code\":\"PE\",\"no\":1,\"indikator\":\"Pertumbuhan Ekonomi\",\"kategori\":\"Statistik Ekonomi\",\"subcategory\":\"PDRB\",\"satuan\":\"Persen\",\"source\":null,\"methodology\":null,\"deskripsi\":\"Pertumbuhan ekonomi merupakan persentase perubahan nilai PDRB ADHK dari satu tahun ke tahun berikutnya yang menggambarkan laju peningkatan aktivitas ekonomi riil di suatu wilayah.\",\"is_active\":1,\"created_by\":\"51670c9e-9f83-11f0-a168-b274a840afeb\",\"category_id\":null,\"created_at\":\"2025-10-09T02:35:25.000Z\",\"updated_at\":\"2025-10-09T02:35:25.000Z\"}]', '{\"is_active\":false}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 03:08:39'),
('3a5c4f6c-bf37-461c-bf14-8f2eb53f64f2', 'indicators', '06f499b3-0ec8-4e8c-9309-04937287e493', 'UPDATE', '[{\"id\":\"06f499b3-0ec8-4e8c-9309-04937287e493\",\"code\":\"IKG\",\"no\":1,\"indikator\":\"Indeks Ketimpangan Gender\",\"kategori\":\"Statistik Lingkungan Hidup & Multi-Domain\",\"subcategory\":\"Gender\",\"satuan\":\"Persen\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"Indeks Ketimpangan Gender merupakan salah satu indikator penting dalam kategori Gender untuk Kabupaten Bungo.\",\"is_active\":1,\"created_by\":\"40574dca-9f87-11f0-a168-b274a840afeb\",\"category_id\":null,\"created_at\":\"2025-10-05T16:14:23.000Z\",\"updated_at\":\"2025-10-05T17:43:18.000Z\"}]', '{\"code\":\"IKG01\",\"no\":1,\"indikator\":\"Indeks Ketimpangan Gender\",\"kategori\":\"Statistik Lingkungan Hidup & Multi-Domain\",\"subcategory\":\"Gender\",\"satuan\":\"Persen\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"Indeks Ketimpangan Gender merupakan salah satu indikator penting dalam kategori Gender untuk Kabupaten Bungo.\",\"category_id\":\"\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Konsep ini mengacu pada definisi standar BPS yang telah disesuaikan dengan kondisi lokal Kabupaten Bungo. Indikator ini mengukur aspek fundamental dari pembangunan daerah.\",\"metode_perhitungan\":\"Data dikumpulkan melalui survei penduduk dan registrasi administrasi kependudukan dengan menggunakan metodologi standar BPS yang telah disesuaikan dengan karakteristik wilayah.\",\"interpretasi\":\"Interpretasi: Indeks Ketimpangan Gender pada periode terkini menunjukkan tren positif. Nilai ini mencerminkan kondisi yang baik dalam kategori Gender di Kabupaten Bungo. Peningkatan dari periode sebelumnya menunjukkan adanya perbaikan yang konsisten.\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-06 14:37:34'),
