('59f32665-cb03-40ea-9409-ea0063f872de', 'indicators', '2fb4a5ae-4307-4c9d-a8f5-7949efe9023f', 'CREATE', NULL, '{\"code\":\"Perkapita04\",\"no\":1,\"indikator\":\"Pertumbuhan PDRB perkapita ADHK\",\"kategori\":\"Statistik Ekonomi\",\"subcategory\":\"PDRB PerKapita\",\"satuan\":\"Persen\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"Pertumbuhan PDRB per Kapita ADHK merupakan persentase perubahan nilai PDRB per kapita atas dasar harga konstan dari satu tahun ke tahun berikutnya yang menunjukkan perkembangan pendapatan riil rata-rata penduduk tanpa pengaruh inflasi.\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Pertumbuhan PDRB per Kapita ADHK adalah tingkat perubahan PDRB per kapita atas dasar harga konstan dari tahun sebelumnya ke tahun berjalan, yang mencerminkan peningkatan kesejahteraan ekonomi masyarakat secara riil tanpa terpengaruh perubahan harga.\",\"metode_perhitungan\":\"Metode perhitungannya dilakukan dengan membandingkan nilai PDRB per kapita ADHK pada tahun berjalan dengan nilai pada tahun sebelumnya, kemudian hasil selisihnya dibagi dengan nilai tahun sebelumnya dan dikalikan 100 persen untuk memperoleh laju pertumbuhan dalam persen.\",\"interpretasi\":\"Pertumbuhan PDRB per Kapita ADHK yang positif menunjukkan adanya peningkatan pendapatan riil rata-rata penduduk, sedangkan nilai negatif menunjukkan penurunan kesejahteraan ekonomi secara riil dibandingkan tahun sebelumnya.\",\"created_by\":\"51670c9e-9f83-11f0-a168-b274a840afeb\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 02:41:14'),
