('5d6e43c4-eda7-49e4-ad12-86fa7d069f62', 'indicators', '6c3ecbe6-ee4f-4a8b-bbea-2b40e4afe391', 'CREATE', NULL, '{\"code\":\"Poor04\",\"no\":1,\"indikator\":\"Indeks Kedalaman Kemiskinan (P1)\",\"kategori\":\"Statistik Demografi & Sosial\",\"subcategory\":\"Kemiskinan\",\"satuan\":\"Persen\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"Indeks Kedalaman Kemiskinan (P1) menunjukkan rata-rata kesenjangan pengeluaran penduduk miskin terhadap garis kemiskinan.\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Indeks Kedalaman Kemiskinan (P1) mengukur seberapa jauh rata-rata pengeluaran penduduk miskin berada di bawah garis kemiskinan, mencerminkan tingkat keparahan ekonomi di kalangan penduduk miskin.\",\"metode_perhitungan\":\"Metode perhitungannya dilakukan dengan menghitung rata-rata selisih antara garis kemiskinan dan pengeluaran penduduk miskin, dinormalisasi terhadap garis kemiskinan. Perhitungannya menggunakan metode Foster-Greer-Thorbecke (FGT).\",\"interpretasi\":\"Semakin tinggi nilai P1, semakin dalam tingkat kemiskinan, karena penduduk miskin semakin jauh dari garis kemiskinan.\",\"created_by\":\"a8bbbd66-9f81-11f0-a168-b274a840afeb\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 03:03:17'),
('5d8ceed8-5247-42a8-a87f-3fdc3659c388', 'indicators', '06f499b3-0ec8-4e8c-9309-04937287e493', 'UPDATE', '[{\"id\":\"06f499b3-0ec8-4e8c-9309-04937287e493\",\"code\":\"IKG01\",\"no\":1,\"indikator\":\"Indeks Ketimpangan Gender\",\"kategori\":\"Statistik Lingkungan Hidup & Multi-Domain\",\"subcategory\":\"Gender\",\"satuan\":\"Persen\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"Indeks Ketimpangan Gender merupakan salah satu indikator penting dalam kategori Gender untuk Kabupaten Bungo.\",\"is_active\":1,\"created_by\":\"40574dca-9f87-11f0-a168-b274a840afeb\",\"category_id\":null,\"created_at\":\"2025-10-05T16:14:23.000Z\",\"updated_at\":\"2025-10-05T17:30:51.000Z\"}]', '{\"code\":\"IKG\",\"no\":1,\"indikator\":\"Indeks Ketimpangan Gender\",\"kategori\":\"Statistik Lingkungan Hidup & Multi-Domain\",\"subcategory\":\"Gender\",\"satuan\":\"Persen\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"Indeks Ketimpangan Gender merupakan salah satu indikator penting dalam kategori Gender untuk Kabupaten Bungo.\",\"category_id\":\"\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Konsep ini mengacu pada definisi standar BPS yang telah disesuaikan dengan kondisi lokal Kabupaten Bungo. Indikator ini mengukur aspek fundamental dari pembangunan daerah.\",\"metode_perhitungan\":\"Data dikumpulkan melalui survei penduduk dan registrasi administrasi kependudukan dengan menggunakan metodologi standar BPS yang telah disesuaikan dengan karakteristik wilayah.\",\"interpretasi\":\"Interpretasi: Indeks Ketimpangan Gender pada periode terkini menunjukkan tren positif. Nilai ini mencerminkan kondisi yang baik dalam kategori Gender di Kabupaten Bungo. Peningkatan dari periode sebelumnya menunjukkan adanya perbaikan yang konsisten.\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-05 17:43:18'),
