('76a13a8b-44d6-4b29-80f8-809fa989a69b', 'indicators', '12f132b0-7405-4c3d-825d-9f1b6ea5abdf', 'CREATE', NULL, '{\"code\":\"PDRB-ADHB\",\"no\":1,\"indikator\":\"PDRB ADHB\",\"kategori\":\"Statistik Ekonomi\",\"subcategory\":\"PDRB\",\"satuan\":\"Juta Rupiah\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"PDRB ADHB merupakan nilai total barang dan jasa yang dihasilkan suatu wilayah pada tahun berjalan berdasarkan harga berlaku tanpa memperhitungkan inflasi.\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Produk Domestik Regional Bruto Atas Dasar Harga Berlaku (PDRB ADHB) merupakan nilai total barang dan jasa akhir yang dihasilkan oleh seluruh unit produksi di wilayah Kabupaten Bungo pada tahun berjalan berdasarkan harga yang berlaku pada tahun tersebut.\",\"metode_perhitungan\":\"PDRB ADHB dihitung dengan menjumlahkan nilai tambah bruto dari seluruh lapangan usaha yang ada di wilayah Kabupaten Bungo, berdasarkan harga berlaku pada tahun bersangkutan.\",\"interpretasi\":\"Nilai PDRB ADHB menunjukkan besarnya aktivitas ekonomi di Kabupaten Bungo pada tahun tertentu. Kenaikan nilai PDRB ADHB dari tahun ke tahun dapat mencerminkan pertumbuhan ekonomi nominal, namun belum memperhitungkan pengaruh inflasi.\",\"created_by\":\"51670c9e-9f83-11f0-a168-b274a840afeb\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 02:31:14'),
('774fc017-3b3c-4275-9cae-07f448edc997', 'indicators', '182db703-87bb-470e-b5fa-6b21d741b37f', 'CREATE', NULL, '{\"code\":\"HLS01\",\"no\":1,\"indikator\":\"HLS\",\"kategori\":\"Statistik Lingkungan Hidup & Multi-Domain\",\"subcategory\":\"Indeks Pembangunan\",\"satuan\":\"Tahun\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"HLS merupakan salah satu indikator penting dalam kategori Indeks Pembangunan untuk Kabupaten Bungo.\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Konsep ini mengacu pada definisi standar BPS yang telah disesuaikan dengan kondisi lokal Kabupaten Bungo. Indikator ini mengukur aspek fundamental dari pembangunan daerah.\",\"metode_perhitungan\":\"Data dikumpulkan melalui survei penduduk dan registrasi administrasi kependudukan dengan menggunakan metodologi standar BPS yang telah disesuaikan dengan karakteristik wilayah.\",\"interpretasi\":\"Interpretasi: HLS pada periode terkini menunjukkan tren positif. Nilai ini mencerminkan kondisi yang baik dalam kategori Indeks Pembangunan di Kabupaten Bungo. Peningkatan dari periode sebelumnya menunjukkan adanya perbaikan yang konsisten.\",\"created_by\":\"40574dca-9f87-11f0-a168-b274a840afeb\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-05 16:07:58'),
('77953444-0c7f-4fbe-a79f-1127ddce4963', 'indicators', 'bab9085e-7ec5-4761-86ef-5d43d2c84235', 'UPDATE', '[{\"id\":\"bab9085e-7ec5-4761-86ef-5d43d2c84235\",\"code\":\"PP\",\"no\":1,\"indikator\":\"Pertumbuhan Penduduk\",\"kategori\":\"Statistik Demografi & Sosial\",\"subcategory\":\"Kependudukan\",\"satuan\":\"Persen\",\"source\":null,\"methodology\":null,\"deskripsi\":\"Pertumbuhan penduduk merupakan persentase perubahan jumlah penduduk dari satu tahun ke tahun berikutnya yang mencerminkan laju peningkatan populasi di suatu wilayah.\",\"is_active\":0,\"created_by\":\"a8bbbd66-9f81-11f0-a168-b274a840afeb\",\"category_id\":null,\"created_at\":\"2025-10-09T02:51:43.000Z\",\"updated_at\":\"2025-10-09T03:05:26.000Z\"}]', '{\"is_active\":true}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 07:26:40'),
