('848e9baf-e0d3-43fa-8abf-113cf57be2b6', 'indicators', 'cdf59d3e-3010-4104-9b11-61b46bc901eb', 'CREATE', NULL, '{\"code\":\"Labour01\",\"no\":1,\"indikator\":\"Jumlah Angkatan Kerja\",\"kategori\":\"Statistik Demografi & Sosial\",\"subcategory\":\"Ketenagakerjaan\",\"satuan\":\"Jiwa\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"Jumlah angkatan kerja merupakan total penduduk usia kerja yang bekerja atau aktif mencari pekerjaan dalam periode tertentu.\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Jumlah angkatan kerja adalah banyaknya penduduk berusia 15 tahun ke atas yang termasuk dalam kategori bekerja atau pengangguran (sedang mencari pekerjaan) di wilayah Kabupaten Bungo pada tahun tertentu.\",\"metode_perhitungan\":\"Metode perhitungannya dilakukan dengan menjumlahkan seluruh penduduk usia kerja yang bekerja dan yang sedang mencari pekerjaan, berdasarkan hasil Survei Angkatan Kerja Nasional (SAKERNAS) atau sumber data ketenagakerjaan lainnya.\",\"interpretasi\":\"Jumlah angkatan kerja menggambarkan potensi tenaga kerja yang tersedia di pasar kerja. Peningkatan jumlah angkatan kerja menunjukkan bertambahnya partisipasi penduduk dalam kegiatan ekonomi.\",\"created_by\":\"a8bbbd66-9f81-11f0-a168-b274a840afeb\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 02:53:15'),
