('8eb7e06e-00f7-468d-aec5-8a02757b21cb', 'indicators', '08d04338-8c03-4d41-ba59-cb34504a0a16', 'CREATE', NULL, '{\"code\":\"Labour05\",\"no\":1,\"indikator\":\"Tingkat Partisipasi Angkatan Kerja (TPAK)\",\"kategori\":\"Statistik Demografi & Sosial\",\"subcategory\":\"Ketenagakerjaan\",\"satuan\":\"Persen\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"TPAK merupakan persentase penduduk usia kerja yang termasuk dalam angkatan kerja dibandingkan dengan total penduduk usia kerja.\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Tingkat Partisipasi Angkatan Kerja (TPAK) menunjukkan proporsi penduduk usia 15 tahun ke atas yang bekerja atau mencari pekerjaan terhadap total penduduk usia kerja di wilayah Kabupaten Bungo.\",\"metode_perhitungan\":\"Metode perhitungannya dilakukan dengan membagi jumlah angkatan kerja dengan jumlah penduduk usia kerja, kemudian dikalikan 100 persen.\",\"interpretasi\":\"TPAK mencerminkan tingkat keterlibatan penduduk usia kerja dalam pasar tenaga kerja. Semakin tinggi TPAK, semakin besar proporsi penduduk yang aktif secara ekonomi.\",\"created_by\":\"a8bbbd66-9f81-11f0-a168-b274a840afeb\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 02:57:45'),
('8ebb65b5-82c8-4f10-abd2-6fe77c2e0b3c', 'indicators', 'b0cc43b8-593a-4c41-bda2-cff88b9e8298', 'CREATE', NULL, '{\"code\":\"Labour06\",\"no\":1,\"indikator\":\"Tingkat Pengangguran Terbuka (TPT)\",\"kategori\":\"Statistik Demografi & Sosial\",\"subcategory\":\"Ketenagakerjaan\",\"satuan\":\"Persen\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"TPT merupakan persentase jumlah pengangguran terhadap total angkatan kerja dalam suatu wilayah pada periode tertentu.\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Tingkat Pengangguran Terbuka (TPT) adalah perbandingan antara jumlah pengangguran dengan jumlah angkatan kerja, yang menggambarkan proporsi penduduk usia kerja yang belum memperoleh pekerjaan meskipun aktif mencarinya.\",\"metode_perhitungan\":\"Metode perhitungannya dilakukan dengan membagi jumlah pengangguran dengan jumlah angkatan kerja, kemudian dikalikan 100 persen.\",\"interpretasi\":\"TPT menunjukkan kondisi pasar kerja di suatu wilayah. Nilai TPT yang tinggi menandakan masih banyak tenaga kerja yang belum terserap, sedangkan nilai rendah menunjukkan pasar kerja yang lebih efisien dan tingkat penyerapan tenaga kerja yang baik.\",\"created_by\":\"a8bbbd66-9f81-11f0-a168-b274a840afeb\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 02:58:27'),
