('8fc367ba-93cd-4f35-9b3a-7f40d00710ec', 'indicators', 'fe709a5c-6098-4c26-8fd9-fada4bef0cc0', 'CREATE', NULL, '{\"code\":\"Population\",\"no\":1,\"indikator\":\"Jumlah Penduduk\",\"kategori\":\"Statistik Demografi & Sosial\",\"subcategory\":\"Kependudukan\",\"satuan\":\"Jiwa\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"Jumlah penduduk merupakan total individu yang berdomisili di suatu wilayah pada periode tertentu, baik laki-laki maupun perempuan.\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Jumlah penduduk adalah banyaknya orang yang bertempat tinggal di wilayah Kabupaten Bungo pada waktu tertentu, termasuk penduduk yang menetap maupun yang telah tinggal selama minimal enam bulan atau bermaksud menetap di wilayah tersebut.\",\"metode_perhitungan\":\"Metode perhitungannya diperoleh dari hasil Sensus Penduduk, Survei Penduduk Antar Sensus (SUPAS), atau proyeksi penduduk yang dihitung berdasarkan data sensus terakhir dengan mempertimbangkan faktor kelahiran, kematian, dan migrasi.\",\"interpretasi\":\"Jumlah penduduk digunakan untuk menggambarkan ukuran populasi suatu wilayah serta menjadi dasar dalam perhitungan berbagai indikator sosial dan ekonomi, seperti PDRB per kapita, kepadatan penduduk, dan rasio ketergantungan.\",\"created_by\":\"a8bbbd66-9f81-11f0-a168-b274a840afeb\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 02:50:23'),
