('9464d02d-ac4e-4a84-a3bd-4fa4eb023904', 'indicators', '17278526-a456-403f-a49b-63c97d50fa1d', 'CREATE', NULL, '{\"code\":\"Labour03\",\"no\":1,\"indikator\":\"Jumlah Pengangguran \",\"kategori\":\"Statistik Demografi & Sosial\",\"subcategory\":\"Ketenagakerjaan\",\"satuan\":\"Jiwa\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"Jumlah pengangguran merupakan total penduduk usia kerja yang tidak bekerja namun aktif mencari pekerjaan selama periode tertentu.\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Jumlah pengangguran adalah banyaknya penduduk berusia 15 tahun ke atas yang sedang tidak bekerja, sedang mencari pekerjaan, atau sedang mempersiapkan usaha baru pada waktu pencacahan berlangsung.\",\"metode_perhitungan\":\"Metode perhitungannya dilakukan dengan menghitung selisih antara jumlah angkatan kerja dan jumlah penduduk bekerja berdasarkan data Survei Angkatan Kerja Nasional (SAKERNAS).\",\"interpretasi\":\"Jumlah pengangguran mencerminkan tingkat tekanan dalam pasar tenaga kerja. Kenaikan jumlah pengangguran menunjukkan berkurangnya peluang kerja, sedangkan penurunan menunjukkan peningkatan penyerapan tenaga kerja di wilayah tersebut.\",\"created_by\":\"a8bbbd66-9f81-11f0-a168-b274a840afeb\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 02:54:47'),
