('97d82b96-5754-4612-851b-00710be04ae3', 'indicators', 'bab9085e-7ec5-4761-86ef-5d43d2c84235', 'CREATE', NULL, '{\"code\":\"PP\",\"no\":1,\"indikator\":\"Pertumbuhan Penduduk\",\"kategori\":\"Statistik Demografi & Sosial\",\"subcategory\":\"Kependudukan\",\"satuan\":\"Persen\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"Pertumbuhan penduduk merupakan persentase perubahan jumlah penduduk dari satu tahun ke tahun berikutnya yang mencerminkan laju peningkatan populasi di suatu wilayah.\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Pertumbuhan penduduk adalah tingkat perubahan jumlah penduduk suatu wilayah dalam jangka waktu tertentu akibat faktor kelahiran, kematian, dan migrasi. Indikator ini menunjukkan seberapa cepat populasi bertambah atau berkurang dari tahun ke tahun.\",\"metode_perhitungan\":\"Metode perhitungannya dilakukan dengan membandingkan jumlah penduduk pada tahun berjalan dengan jumlah penduduk pada tahun sebelumnya, kemudian selisihnya dibagi dengan jumlah penduduk tahun sebelumnya dan dikalikan 100 persen untuk mendapatkan laju pertumbuhan penduduk tahunan.\",\"interpretasi\":\"Nilai pertumbuhan penduduk yang positif menunjukkan adanya peningkatan jumlah penduduk, sedangkan nilai negatif menunjukkan penurunan populasi. Laju pertumbuhan penduduk yang tinggi dapat berdampak pada kebutuhan pembangunan, penyediaan lapangan kerja, serta pelayanan publik di wilayah tersebut.\",\"created_by\":\"a8bbbd66-9f81-11f0-a168-b274a840afeb\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 02:51:43'),
('97fadfd4-a4db-11f0-b0b6-b274a840afeb', 'indicators', 'eb8442fe-13c2-483f-b941-cf7f72871deb', 'UPDATE', '{\"code\": \"Labour02\", \"indikator\": \"Jumlah Penduduk Bekerja\", \"kategori\": \"Statistik Demografi & Sosial\", \"subcategory\": \"Ketenagakerjaan\", \"satuan\": \"Jiwa\"}', '{\"code\": \"Labour02\", \"indikator\": \"Jumlah Penduduk Bekerja\", \"kategori\": \"Statistik Demografi & Sosial\", \"subcategory\": \"Ketenagakerjaan\", \"satuan\": \"Jiwa\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 06:45:50'),
('98ae075e-a5d4-45a8-9f44-d350d030d001', 'indicators', '085b27a5-756b-4725-94db-c1077e992e3a', 'CREATE', NULL, '{\"code\":\"RLS01\",\"no\":1,\"indikator\":\"RLS\",\"kategori\":\"Statistik Lingkungan Hidup & Multi-Domain\",\"subcategory\":\"Indeks Pembangunan\",\"satuan\":\"Tahun\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"RLS merupakan salah satu indikator penting dalam kategori Indeks Pembangunan untuk Kabupaten Bungo.\\n\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Konsep ini mengacu pada definisi standar BPS yang telah disesuaikan dengan kondisi lokal Kabupaten Bungo. Indikator ini mengukur aspek fundamental dari pembangunan daerah.\",\"metode_perhitungan\":\"Data dikumpulkan melalui survei penduduk dan registrasi administrasi kependudukan dengan menggunakan metodologi standar BPS yang telah disesuaikan dengan karakteristik wilayah.\",\"interpretasi\":\"Interpretasi: RLS pada periode terkini menunjukkan tren positif. Nilai ini mencerminkan kondisi yang baik dalam kategori Indeks Pembangunan di Kabupaten Bungo. Peningkatan dari periode sebelumnya menunjukkan adanya perbaikan yang konsisten.\",\"created_by\":\"40574dca-9f87-11f0-a168-b274a840afeb\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-05 16:08:53'),
