('bcc44e0b-1e75-45a0-b306-d9eb89252c66', 'indicators', 'ef4991fb-f4ec-43e1-8233-e73774b15e75', 'UPDATE', '[{\"id\":\"ef4991fb-f4ec-43e1-8233-e73774b15e75\",\"code\":\"Poor01\",\"no\":1,\"indikator\":\"Garis Kemiskinan\",\"kategori\":\"Statistik Demografi & Sosial\",\"subcategory\":\"Kemiskinan\",\"satuan\":\"Rp/bulan/Kapita\",\"source\":null,\"methodology\":null,\"deskripsi\":\"Garis kemiskinan merupakan batas nilai pengeluaran minimum per kapita per bulan yang diperlukan untuk memenuhi kebutuhan dasar makanan dan nonmakanan.\",\"is_active\":1,\"created_by\":\"a8bbbd66-9f81-11f0-a168-b274a840afeb\",\"category_id\":null,\"created_at\":\"2025-10-09T02:59:43.000Z\",\"updated_at\":\"2025-10-09T02:59:43.000Z\"}]', '{\"code\":\"Poor01\",\"no\":1,\"indikator\":\"Garis Kemiskinan\",\"kategori\":\"Statistik Demografi & Sosial\",\"subcategory\":\"Kemiskinan\",\"satuan\":\"Rp/bulan/Kapita\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"Garis kemiskinan merupakan batas nilai pengeluaran minimum per kapita per bulan yang diperlukan untuk memenuhi kebutuhan dasar makanan dan nonmakanan.\",\"category_id\":\"\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Garis kemiskinan adalah nilai pengeluaran minimum yang diperlukan seseorang untuk memenuhi kebutuhan dasar hidup layak, meliputi kebutuhan makanan yang setara dengan 2.100 kalori per kapita per hari dan kebutuhan nonmakanan seperti perumahan, pendidikan, serta kesehatan.\",\"metode_perhitungan\":\"Metode perhitungannya dilakukan dengan menjumlahkan Garis Kemiskinan Makanan (GKM) dan Garis Kemiskinan Nonmakanan (GKNM), yang diperoleh dari hasil Survei Sosial Ekonomi Nasional (Susenas).\",\"interpretasi\":\"Penduduk dengan pengeluaran per kapita per bulan di bawah garis kemiskinan dikategorikan sebagai penduduk miskin. Kenaikan garis kemiskinan menunjukkan meningkatnya biaya kebutuhan dasar di wilayah tersebut.\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 03:01:05'),
