('cf43571c-0b91-43e2-a14b-49d665772f2b', 'indicators', '980ed2a0-6b68-41ae-9b20-659d6baa0d94', 'UPDATE', '[{\"id\":\"980ed2a0-6b68-41ae-9b20-659d6baa0d94\",\"code\":\"Perkapita02\",\"no\":1,\"indikator\":\"PDRB per Kapita per Tahun ADHK\",\"kategori\":\"Statistik Ekonomi\",\"subcategory\":\"PDRB PerKapita\",\"satuan\":\"Juta Rupiah\",\"source\":null,\"methodology\":null,\"deskripsi\":\"PDRB per Kapita per Tahun ADHK merupakan nilai rata-rata PDRB Atas Dasar Harga Konstan yang diterima setiap penduduk dalam satu tahun berdasarkan harga pada tahun dasar, sehingga mencerminkan kesejahteraan riil masyarakat tanpa pengaruh inflasi.\",\"is_active\":0,\"created_by\":\"51670c9e-9f83-11f0-a168-b274a840afeb\",\"category_id\":null,\"created_at\":\"2025-10-09T02:38:18.000Z\",\"updated_at\":\"2025-10-09T03:08:43.000Z\",\"period_type\":\"yearly\"}]', '{\"is_active\":true}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 12:43:32'),
