('d0197a52-e2c6-4a59-867e-f243f11f6dc8', 'indicators', 'd82df91a-ee08-4d30-9fb2-b566bed08956', 'CREATE', NULL, '{\"code\":\"Poor05\",\"no\":1,\"indikator\":\"Indeks Keparahan Kemiskinan (P2)\",\"kategori\":\"Statistik Demografi & Sosial\",\"subcategory\":\"Kemiskinan\",\"satuan\":\"Persen\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"Indeks Keparahan Kemiskinan (P2) menunjukkan tingkat ketimpangan pengeluaran di antara penduduk miskin.\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Indeks Keparahan Kemiskinan (P2) menggambarkan variasi pengeluaran di antara penduduk miskin, yang menunjukkan ketimpangan di kelompok masyarakat miskin.\",\"metode_perhitungan\":\"Metode perhitungannya dilakukan dengan memperhitungkan kuadrat selisih antara garis kemiskinan dan pengeluaran penduduk miskin terhadap garis kemiskinan, menggunakan pendekatan Foster-Greer-Thorbecke (FGT).\",\"interpretasi\":\"Semakin besar nilai P2, semakin tinggi ketimpangan di antara penduduk miskin, menunjukkan sebagian penduduk miskin berada jauh di bawah garis kemiskinan.\",\"created_by\":\"a8bbbd66-9f81-11f0-a168-b274a840afeb\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 03:03:59'),
