('d8a2e478-3697-46a2-b9cb-fb738939367d', 'indicators', 'ac35d74c-d7ab-4062-8dfa-af15e158930c', 'CREATE', NULL, '{\"code\":\"PDRB-ADHK\",\"no\":1,\"indikator\":\"PDRB ADHK\",\"kategori\":\"Statistik Ekonomi\",\"subcategory\":\"PDRB\",\"satuan\":\"Juta Rupiah\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"PDRB ADHK merupakan nilai total barang dan jasa yang dihasilkan suatu wilayah pada tahun berjalan berdasarkan harga tahun dasar sehingga mencerminkan pertumbuhan ekonomi riil tanpa pengaruh inflasi.\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Produk Domestik Regional Bruto Atas Dasar Harga Konstan (PDRB ADHK) merupakan nilai total barang dan jasa akhir yang dihasilkan oleh seluruh unit produksi di wilayah Kabupaten Bungo pada tahun berjalan yang dihitung menggunakan harga pada tahun dasar tertentu, sehingga mencerminkan perubahan volume produksi tanpa terpengaruh inflasi.\",\"metode_perhitungan\":\"PDRB ADHK diperoleh dengan menilai seluruh komponen PDRB berdasarkan harga pada tahun dasar (misalnya tahun 2010 atau 2015), menggunakan metode deflasi atau revaluasi terhadap data PDRB ADHB agar mencerminkan perubahan riil dalam output.\",\"interpretasi\":\"Nilai PDRB ADHK menggambarkan pertumbuhan ekonomi riil di Kabupaten Bungo dari waktu ke waktu. Kenaikan nilai PDRB ADHK menunjukkan adanya peningkatan produksi barang dan jasa secara nyata, bukan akibat perubahan harga.\",\"created_by\":\"51670c9e-9f83-11f0-a168-b274a840afeb\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 02:32:38'),
