('de900a5b-d56f-4f2f-9358-9c9fd652d4d1', 'indicators', '14f39e45-0c34-43e9-b2cc-ed564d2e50dc', 'CREATE', NULL, '{\"code\":\"Perkapita03\",\"no\":1,\"indikator\":\"Pertumbuhan PDRB perkapita ADHB\",\"kategori\":\"Statistik Ekonomi\",\"subcategory\":\"PDRB PerKapita\",\"satuan\":\"Persen\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"Pertumbuhan PDRB per Kapita ADHB merupakan persentase perubahan nilai PDRB per kapita atas dasar harga berlaku dari satu tahun ke tahun berikutnya yang menunjukkan perkembangan rata-rata pendapatan nominal penduduk suatu wilayah.\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Pertumbuhan PDRB per Kapita ADHB adalah tingkat perubahan PDRB per kapita atas dasar harga berlaku dari tahun sebelumnya ke tahun berjalan, yang mencerminkan peningkatan atau penurunan pendapatan nominal rata-rata penduduk suatu wilayah tanpa memperhitungkan inflasi.\",\"metode_perhitungan\":\"Metode perhitungannya dilakukan dengan membandingkan nilai PDRB per kapita ADHB pada tahun berjalan dengan tahun sebelumnya, kemudian hasil selisihnya dibagi dengan nilai tahun sebelumnya dan dikalikan 100 persen untuk memperoleh laju pertumbuhan dalam persen.\",\"interpretasi\":\"Nilai pertumbuhan PDRB per Kapita ADHB yang positif menunjukkan adanya peningkatan pendapatan nominal rata-rata penduduk, sedangkan nilai negatif menunjukkan penurunan. Indikator ini menggambarkan dinamika kesejahteraan masyarakat secara nominal tanpa memperhitungkan efek inflasi.\",\"created_by\":\"51670c9e-9f83-11f0-a168-b274a840afeb\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 02:39:44'),
