('f4aa6a09-1129-4c91-9ae1-04ad9e90d023', 'indicators', '0e428f5f-ce75-47a1-af88-a662df25f577', 'CREATE', NULL, '{\"code\":\"Labour04\",\"no\":1,\"indikator\":\"Jumlah Bukan Angkatan Kerja\",\"kategori\":\"Statistik Demografi & Sosial\",\"subcategory\":\"Ketenagakerjaan\",\"satuan\":\"Jiwa\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"Jumlah bukan angkatan kerja merupakan total penduduk usia kerja yang tidak termasuk dalam kelompok bekerja maupun mencari pekerjaan.\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Jumlah bukan angkatan kerja adalah banyaknya penduduk berusia 15 tahun ke atas yang tidak bekerja dan tidak aktif mencari pekerjaan, seperti pelajar, mahasiswa, ibu rumah tangga, serta mereka yang tidak mampu atau tidak ingin bekerja.\",\"metode_perhitungan\":\"Metode perhitungannya dilakukan dengan menghitung seluruh penduduk usia kerja yang tidak termasuk dalam kategori angkatan kerja (bekerja atau pengangguran), berdasarkan hasil Survei Angkatan Kerja Nasional (SAKERNAS).\",\"interpretasi\":\"Jumlah bukan angkatan kerja menggambarkan besarnya bagian populasi usia kerja yang tidak berpartisipasi dalam kegiatan ekonomi. Nilainya dapat dipengaruhi oleh faktor pendidikan, kondisi sosial, dan kesempatan kerja.\",\"created_by\":\"a8bbbd66-9f81-11f0-a168-b274a840afeb\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 02:56:57'),
('f50de6f0-59c4-4a47-b1ac-2cfbfa77afa0', 'indicators', '47afd60f-f195-4930-a5c0-c7d61b0d24fe', 'CREATE', NULL, '{\"code\":\"PPP-SP2010\",\"no\":1,\"indikator\":\"Pengeluaran Perkapita Pertahun SP2010\",\"kategori\":\"Statistik Lingkungan Hidup & Multi-Domain\",\"subcategory\":\"Indeks Pembangunan\",\"satuan\":\"Ribu Rupiah\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"Pengeluaran Perkapita Pertahun SP2010 merupakan salah satu indikator penting dalam kategori Indeks Pembangunan untuk Kabupaten Bungo.\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"Konsep ini mengacu pada definisi standar BPS yang telah disesuaikan dengan kondisi lokal Kabupaten Bungo. Indikator ini mengukur aspek fundamental dari pembangunan daerah.\",\"metode_perhitungan\":\"Data dikumpulkan melalui survei penduduk dan registrasi administrasi kependudukan dengan menggunakan metodologi standar BPS yang telah disesuaikan dengan karakteristik wilayah.\",\"interpretasi\":\"Interpretasi: Pengeluaran Perkapita Pertahun SP2010 pada periode terkini menunjukkan tren positif. Nilai ini mencerminkan kondisi yang baik dalam kategori Indeks Pembangunan di Kabupaten Bungo. Peningkatan dari periode sebelumnya menunjukkan adanya perbaikan yang konsisten.\",\"created_by\":\"40574dca-9f87-11f0-a168-b274a840afeb\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-05 16:10:13'),
