('f64b7c13-d6d0-441a-aaa4-b474fbaa8ead', 'indicators', '98e7e7de-5de2-480b-9c20-2fe9cec25554', 'CREATE', NULL, '{\"code\":\"Perkapita01\",\"no\":1,\"indikator\":\"PDRB per Kapita per Tahun ADHB\",\"kategori\":\"Statistik Ekonomi\",\"subcategory\":\"PDRB PerKapita\",\"satuan\":\"Juta Rupiah\",\"source\":\"\",\"methodology\":\"\",\"deskripsi\":\"PDRB per Kapita per Tahun ADHB merupakan nilai rata-rata PDRB Atas Dasar Harga Berlaku yang diterima setiap penduduk dalam satu tahun berdasarkan harga pada tahun berjalan.\",\"level\":\"Kabupaten\",\"wilayah\":\"Kabupaten Bungo\",\"periode\":\"Tahunan\",\"konsep_definisi\":\"\",\"metode_perhitungan\":\"PDRBperKapitaADHB= PDRBADHB/JumlahPenduduk\\ndengan PDRB ADHB diukur berdasarkan harga berlaku pada tahun bersangkutan.\",\"interpretasi\":\"PDRB per Kapita ADHB menunjukkan rata-rata nilai barang dan jasa yang dihasilkan per penduduk dalam satu tahun. Kenaikan indikator ini dapat mencerminkan peningkatan kesejahteraan nominal masyarakat, namun belum memperhitungkan pengaruh inflasi atau distribusi pendapatan.\",\"created_by\":\"51670c9e-9f83-11f0-a168-b274a840afeb\"}', NULL, NULL, NULL, NULL, NULL, '2025-10-09 02:36:55'),
