INSERT INTO `faqs` (`id`, `question`, `answer`, `category`, `author_id`, `is_active`, `is_featured`, `order_number`, `views_count`, `created_at`, `updated_at`, `status`, `user_email`, `user_phone`, `user_full_name`, `answered_by`, `answered_at`) VALUES
('35a76768-e4c0-4df4-9336-727e6e480f11', 'apa itu bps', 'fjkjhk', 'umum', NULL, 1, 0, NULL, 0, '2025-10-09 01:19:55', '2025-10-10 03:11:35', 'answered', 'kkevin@gmail.com', '082345678', 'kevinatga', NULL, '2025-10-10 03:11:35'),
('4', 'Bagaimana cara melihat data lingkungan terbaru?', 'Data lingkungan dapat diakses melalui dashboard statistik lingkungan hidup. Data meliputi kualitas udara, air, dan indikator keberlanjutan lainnya.', 'lingkungan', NULL, 1, 1, 1, 0, '2025-10-09 00:46:29', '2025-10-09 00:46:29', 'published', NULL, NULL, NULL, NULL, NULL),
('437dcbef-3999-4a33-bcef-fb2f2235473c', 'Cara Membaca dan Memahami Data Statistik?', 'Data statistik dapat dibaca dengan memperhatikan satuan, periode waktu, dan metodologi pengumpulan data. Pastikan untuk memahami definisi dan konsep yang digunakan.', 'lingkungan', NULL, 1, 1, NULL, 0, '2025-10-07 13:21:14', '2025-10-08 23:11:01', 'published', 'admin@bps-bungo.id', '-', 'Admin BPS Bungo', NULL, '2025-10-08 23:10:57'),
('5', 'Apa itu Indeks Kualitas Lingkungan Hidup?', 'Indeks Kualitas Lingkungan Hidup (IKLH) adalah indikator komposit yang mengukur tingkat kualitas lingkungan hidup di suatu daerah berdasarkan komponen udara, air, dan tutupan lahan.', 'lingkungan', NULL, 1, 1, 1, 0, '2025-10-09 00:46:29', '2025-10-09 00:46:29', 'published', NULL, NULL, NULL, NULL, NULL),
('58e8a320-a657-47c8-9c4d-b27009259cd9', 'Peran statistik dalam pembangunan daerah', 'Statistik berperan penting dalam perencanaan, monitoring, dan evaluasi pembangunan daerah. Data statistik menjadi dasar pengambilan keputusan kebijakan.', 'ekonomi', NULL, 1, 1, NULL, 0, '2025-10-07 13:22:41', '2025-10-08 23:10:43', 'published', 'admin@bps-bungo.id', '-', 'Admin BPS Bungo', NULL, '2025-10-08 23:10:39'),
('6', 'Bagaimana interpretasi data ekonomi regional?', 'Data ekonomi regional dapat diinterpretasikan melalui pertumbuhan PDRB, struktur ekonomi sektoral, dan perbandingan antar daerah. Perhatikan tren jangka panjang untuk analisis yang lebih akurat.', 'ekonomi', NULL, 1, 1, 1, 0, '2025-10-09 00:46:29', '2025-10-09 00:46:29', 'published', NULL, NULL, NULL, NULL, NULL),
('7', 'Apa saja indikator ekonomi utama yang dipantau BPS?', 'Indikator ekonomi utama meliputi PDRB, inflasi regional, tingkat pengangguran terbuka, indeks pembangunan manusia, dan neraca perdagangan daerah.', 'ekonomi', NULL, 1, 1, 1, 0, '2025-10-09 00:46:29', '2025-10-09 00:46:29', 'published', NULL, NULL, NULL, NULL, NULL),
('8', 'Bagaimana cara membaca data demografi penduduk?', 'Data demografi mencakup jumlah penduduk, struktur umur, rasio jenis kelamin, tingkat pertumbuhan penduduk, dan distribusi geografis. Gunakan piramida penduduk untuk analisis struktur umur.', 'demografi', NULL, 1, 1, 1, 0, '2025-10-09 00:46:29', '2025-10-09 00:46:29', 'published', NULL, NULL, NULL, NULL, NULL),
('a807e7e4-582c-4984-80e0-3c3817ba3ea1', 'Bagaimana Cara Mengakses Data Statistik BPS?', 'Data statistik BPS dapat diakses melalui website resmi, publikasi cetak, atau dengan mengunjungi kantor BPS setempat. Beberapa data tersedia gratis untuk umum.', 'demografi', NULL, 1, 1, NULL, 0, '2025-10-07 13:23:11', '2025-10-08 23:10:29', 'published', 'admin@bps-bungo.id', '-', 'Admin BPS Bungo', NULL, '2025-10-08 23:10:23');
