('12f132b0-7405-4c3d-825d-9f1b6ea5abdf', 'PDRB-ADHB', 1, 'PDRB ADHB', 'Statistik Ekonomi', 'PDRB', 'Juta Rupiah', NULL, NULL, 'PDRB ADHB merupakan nilai total barang dan jasa yang dihasilkan suatu wilayah pada tahun berjalan berdasarkan harga berlaku tanpa memperhitungkan inflasi.', 1, NULL, NULL, '2025-10-09 02:31:14', '2025-10-09 07:07:43', 'yearly'),
('14f39e45-0c34-43e9-b2cc-ed564d2e50dc', 'Perkapita03', 1, 'Pertumbuhan PDRB perkapita ADHB', 'Statistik Ekonomi', 'PDRB PerKapita', 'Persen', NULL, NULL, 'Pertumbuhan PDRB per Kapita ADHB merupakan persentase perubahan nilai PDRB per kapita atas dasar harga berlaku dari satu tahun ke tahun berikutnya yang menunjukkan perkembangan rata-rata pendapatan nominal penduduk suatu wilayah.', 1, NULL, NULL, '2025-10-09 02:39:44', '2025-10-09 12:43:31', 'yearly'),
('17278526-a456-403f-a49b-63c97d50fa1d', 'Labour03', 1, 'Jumlah Pengangguran ', 'Statistik Demografi & Sosial', 'Ketenagakerjaan', 'Jiwa', NULL, NULL, 'Jumlah pengangguran merupakan total penduduk usia kerja yang tidak bekerja namun aktif mencari pekerjaan selama periode tertentu.', 0, NULL, NULL, '2025-10-09 02:54:47', '2025-10-09 03:05:19', 'yearly'),
