('b0cc43b8-593a-4c41-bda2-cff88b9e8298', 'Labour06', 1, 'Tingkat Pengangguran Terbuka (TPT)', 'Statistik Demografi & Sosial', 'Ketenagakerjaan', 'Persen', NULL, NULL, 'TPT merupakan persentase jumlah pengangguran terhadap total angkatan kerja dalam suatu wilayah pada periode tertentu.', 1, NULL, NULL, '2025-10-09 02:58:27', '2025-10-09 07:26:42', 'yearly'),
('bab9085e-7ec5-4761-86ef-5d43d2c84235', 'PP', 1, 'Pertumbuhan Penduduk', 'Statistik Demografi & Sosial', 'Kependudukan', 'Persen', NULL, NULL, 'Pertumbuhan penduduk merupakan persentase perubahan jumlah penduduk dari satu tahun ke tahun berikutnya yang mencerminkan laju peningkatan populasi di suatu wilayah.', 1, NULL, NULL, '2025-10-09 02:51:43', '2025-10-09 07:26:40', 'yearly'),
