    INSERT INTO data_audit_log (table_name, record_id, action, old_values, new_values, user_id)
INSERT INTO `indicator_metadata` (`id`, `indicator_id`, `level`, `wilayah`, `periode`, `frequency`, `konsep_definisi`, `metode_perhitungan`, `interpretasi`, `unit_description`, `data_quality_notes`, `last_updated_by`, `sumber_data`, `created_at`, `updated_at`) VALUES
('00721b88-60ed-4d84-85ad-ab0579f2550d', 'cdf59d3e-3010-4104-9b11-61b46bc901eb', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Jumlah angkatan kerja adalah banyaknya penduduk berusia 15 tahun ke atas yang termasuk dalam kategori bekerja atau pengangguran (sedang mencari pekerjaan) di wilayah Kabupaten Bungo pada tahun tertentu.', 'Metode perhitungannya dilakukan dengan menjumlahkan seluruh penduduk usia kerja yang bekerja dan yang sedang mencari pekerjaan, berdasarkan hasil Survei Angkatan Kerja Nasional (SAKERNAS) atau sumber data ketenagakerjaan lainnya.', 'Jumlah angkatan kerja menggambarkan potensi tenaga kerja yang tersedia di pasar kerja. Peningkatan jumlah angkatan kerja menunjukkan bertambahnya partisipasi penduduk dalam kegiatan ekonomi.', NULL, NULL, NULL, NULL, '2025-10-09 02:53:15', '2025-10-09 02:53:15'),
('0113c536-ed32-4dbd-abed-a1ac0b3e5e03', '1ce4557a-4a94-41a8-aab6-3565bbd0b9f5', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Konsep ini mengacu pada definisi standar BPS yang telah disesuaikan dengan kondisi lokal Kabupaten Bungo. Indikator ini mengukur aspek fundamental dari pembangunan daerah.', 'Data dikumpulkan melalui survei penduduk dan registrasi administrasi kependudukan dengan menggunakan metodologi standar BPS yang telah disesuaikan dengan karakteristik wilayah.', 'Interpretasi: UHH SP2020LF pada periode terkini menunjukkan tren positif. Nilai ini mencerminkan kondisi yang baik dalam kategori Indeks Pembangunan di Kabupaten Bungo. Peningkatan dari periode sebelumnya menunjukkan adanya perbaikan yang konsisten.', NULL, NULL, NULL, NULL, '2025-10-05 16:06:51', '2025-10-05 16:06:51'),
('028ba0d5-91af-49c5-96b1-4aeb31616e98', 'fe709a5c-6098-4c26-8fd9-fada4bef0cc0', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Jumlah penduduk adalah banyaknya orang yang bertempat tinggal di wilayah Kabupaten Bungo pada waktu tertentu, termasuk penduduk yang menetap maupun yang telah tinggal selama minimal enam bulan atau bermaksud menetap di wilayah tersebut.', 'Metode perhitungannya diperoleh dari hasil Sensus Penduduk, Survei Penduduk Antar Sensus (SUPAS), atau proyeksi penduduk yang dihitung berdasarkan data sensus terakhir dengan mempertimbangkan faktor kelahiran, kematian, dan migrasi.', 'Jumlah penduduk digunakan untuk menggambarkan ukuran populasi suatu wilayah serta menjadi dasar dalam perhitungan berbagai indikator sosial dan ekonomi, seperti PDRB per kapita, kepadatan penduduk, dan rasio ketergantungan.', NULL, NULL, NULL, NULL, '2025-10-09 02:50:23', '2025-10-09 02:50:23'),
('10a9e79b-ee73-4d13-ae37-30c8e9e45417', 'ce223e00-312f-490c-8f11-40c55ef6899a', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Konsep ini mengacu pada definisi standar BPS yang telah disesuaikan dengan kondisi lokal Kabupaten Bungo. Indikator ini mengukur aspek fundamental dari pembangunan daerah.', 'Data dikumpulkan melalui survei penduduk dan registrasi administrasi kependudukan dengan menggunakan metodologi standar BPS yang telah disesuaikan dengan karakteristik wilayah.', 'Interpretasi: IPG pada periode terkini menunjukkan tren positif. Nilai ini mencerminkan kondisi yang baik dalam kategori Gender di Kabupaten Bungo. Peningkatan dari periode sebelumnya menunjukkan adanya perbaikan yang konsisten.', NULL, NULL, NULL, NULL, '2025-10-05 16:12:26', '2025-10-05 16:12:26'),
('2088e0cc-840c-45c1-9e69-640b30d49bad', '12f132b0-7405-4c3d-825d-9f1b6ea5abdf', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Produk Domestik Regional Bruto Atas Dasar Harga Berlaku (PDRB ADHB) merupakan nilai total barang dan jasa akhir yang dihasilkan oleh seluruh unit produksi di wilayah Kabupaten Bungo pada tahun berjalan berdasarkan harga yang berlaku pada tahun tersebut.', 'PDRB ADHB dihitung dengan menjumlahkan nilai tambah bruto dari seluruh lapangan usaha yang ada di wilayah Kabupaten Bungo, berdasarkan harga berlaku pada tahun bersangkutan.', 'Nilai PDRB ADHB menunjukkan besarnya aktivitas ekonomi di Kabupaten Bungo pada tahun tertentu. Kenaikan nilai PDRB ADHB dari tahun ke tahun dapat mencerminkan pertumbuhan ekonomi nominal, namun belum memperhitungkan pengaruh inflasi.', NULL, NULL, NULL, NULL, '2025-10-09 02:31:14', '2025-10-09 02:31:14'),
('26da5da8-8496-4ad6-8a92-2aa172411683', '14f39e45-0c34-43e9-b2cc-ed564d2e50dc', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Pertumbuhan PDRB per Kapita ADHB adalah tingkat perubahan PDRB per kapita atas dasar harga berlaku dari tahun sebelumnya ke tahun berjalan, yang mencerminkan peningkatan atau penurunan pendapatan nominal rata-rata penduduk suatu wilayah tanpa memperhitungkan inflasi.', 'Metode perhitungannya dilakukan dengan membandingkan nilai PDRB per kapita ADHB pada tahun berjalan dengan tahun sebelumnya, kemudian hasil selisihnya dibagi dengan nilai tahun sebelumnya dan dikalikan 100 persen untuk memperoleh laju pertumbuhan dalam persen.', 'Nilai pertumbuhan PDRB per Kapita ADHB yang positif menunjukkan adanya peningkatan pendapatan nominal rata-rata penduduk, sedangkan nilai negatif menunjukkan penurunan. Indikator ini menggambarkan dinamika kesejahteraan masyarakat secara nominal tanpa memperhitungkan efek inflasi.', NULL, NULL, NULL, NULL, '2025-10-09 02:39:44', '2025-10-09 02:39:44'),
('2abade3d-b292-4e57-b4ac-3f9b02a2592d', 'bab9085e-7ec5-4761-86ef-5d43d2c84235', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Pertumbuhan penduduk adalah tingkat perubahan jumlah penduduk suatu wilayah dalam jangka waktu tertentu akibat faktor kelahiran, kematian, dan migrasi. Indikator ini menunjukkan seberapa cepat populasi bertambah atau berkurang dari tahun ke tahun.', 'Metode perhitungannya dilakukan dengan membandingkan jumlah penduduk pada tahun berjalan dengan jumlah penduduk pada tahun sebelumnya, kemudian selisihnya dibagi dengan jumlah penduduk tahun sebelumnya dan dikalikan 100 persen untuk mendapatkan laju pertumbuhan penduduk tahunan.', 'Nilai pertumbuhan penduduk yang positif menunjukkan adanya peningkatan jumlah penduduk, sedangkan nilai negatif menunjukkan penurunan populasi. Laju pertumbuhan penduduk yang tinggi dapat berdampak pada kebutuhan pembangunan, penyediaan lapangan kerja, serta pelayanan publik di wilayah tersebut.', NULL, NULL, NULL, NULL, '2025-10-09 02:51:43', '2025-10-09 02:51:43'),
('2cb3546d-20e6-4522-aacc-89373ed0ceba', '085b27a5-756b-4725-94db-c1077e992e3a', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Konsep ini mengacu pada definisi standar BPS yang telah disesuaikan dengan kondisi lokal Kabupaten Bungo. Indikator ini mengukur aspek fundamental dari pembangunan daerah.', 'Data dikumpulkan melalui survei penduduk dan registrasi administrasi kependudukan dengan menggunakan metodologi standar BPS yang telah disesuaikan dengan karakteristik wilayah.', 'Interpretasi: RLS pada periode terkini menunjukkan tren positif. Nilai ini mencerminkan kondisi yang baik dalam kategori Indeks Pembangunan di Kabupaten Bungo. Peningkatan dari periode sebelumnya menunjukkan adanya perbaikan yang konsisten.', NULL, NULL, NULL, NULL, '2025-10-05 16:08:53', '2025-10-05 16:08:53'),
('3666e35d-22c6-474b-94ef-fd2b5105da58', '06f499b3-0ec8-4e8c-9309-04937287e493', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Konsep ini mengacu pada definisi standar BPS yang telah disesuaikan dengan kondisi lokal Kabupaten Bungo. Indikator ini mengukur aspek fundamental dari pembangunan daerah.', 'Data dikumpulkan melalui survei penduduk dan registrasi administrasi kependudukan dengan menggunakan metodologi standar BPS yang telah disesuaikan dengan karakteristik wilayah.', 'Interpretasi: Indeks Ketimpangan Gender pada periode terkini menunjukkan tren positif. Nilai ini mencerminkan kondisi yang baik dalam kategori Gender di Kabupaten Bungo. Peningkatan dari periode sebelumnya menunjukkan adanya perbaikan yang konsisten.', NULL, NULL, NULL, NULL, '2025-10-05 16:14:23', '2025-10-09 18:01:14'),
