('5c9b4207-98a9-4ae0-b5a3-64fa94e8a50e', '182db703-87bb-470e-b5fa-6b21d741b37f', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Konsep ini mengacu pada definisi standar BPS yang telah disesuaikan dengan kondisi lokal Kabupaten Bungo. Indikator ini mengukur aspek fundamental dari pembangunan daerah.', 'Data dikumpulkan melalui survei penduduk dan registrasi administrasi kependudukan dengan menggunakan metodologi standar BPS yang telah disesuaikan dengan karakteristik wilayah.', 'Interpretasi: HLS pada periode terkini menunjukkan tren positif. Nilai ini mencerminkan kondisi yang baik dalam kategori Indeks Pembangunan di Kabupaten Bungo. Peningkatan dari periode sebelumnya menunjukkan adanya perbaikan yang konsisten.', NULL, NULL, NULL, NULL, '2025-10-05 16:07:58', '2025-10-05 16:07:58'),
('61c95e2e-c2b6-4eaa-9db7-956f869f9703', 'b0cc43b8-593a-4c41-bda2-cff88b9e8298', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Tingkat Pengangguran Terbuka (TPT) adalah perbandingan antara jumlah pengangguran dengan jumlah angkatan kerja, yang menggambarkan proporsi penduduk usia kerja yang belum memperoleh pekerjaan meskipun aktif mencarinya.', 'Metode perhitungannya dilakukan dengan membagi jumlah pengangguran dengan jumlah angkatan kerja, kemudian dikalikan 100 persen.', 'TPT menunjukkan kondisi pasar kerja di suatu wilayah. Nilai TPT yang tinggi menandakan masih banyak tenaga kerja yang belum terserap, sedangkan nilai rendah menunjukkan pasar kerja yang lebih efisien dan tingkat penyerapan tenaga kerja yang baik.', NULL, NULL, NULL, NULL, '2025-10-09 02:58:27', '2025-10-09 02:58:27'),
('6278bdd0-f1f2-429c-b626-e1cfa01f5568', '34b26ad7-05b2-4467-9de8-5467cac993ea', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Jumlah penduduk miskin adalah banyaknya penduduk yang tidak mampu memenuhi kebutuhan dasar makanan dan nonmakanan karena pengeluarannya berada di bawah garis kemiskinan.', 'Metode perhitungannya dilakukan dengan mengalikan persentase penduduk miskin (P0) dengan jumlah penduduk, berdasarkan hasil penghitungan kemiskinan yang bersumber dari data Susenas.', 'Jumlah penduduk miskin menggambarkan skala kemiskinan secara absolut di wilayah tertentu. Penurunan jumlah ini mencerminkan perbaikan kesejahteraan masyarakat secara umum.', NULL, NULL, NULL, NULL, '2025-10-09 03:00:46', '2025-10-09 03:00:46'),
('670af0f5-90a5-4e72-a0fa-a60230e09dd8', '980ed2a0-6b68-41ae-9b20-659d6baa0d94', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'PDRB per Kapita ADHK adalah nilai Produk Domestik Regional Bruto Atas Dasar Harga Konstan yang dibagi dengan jumlah penduduk pada tahun yang sama, dihitung menggunakan harga tahun dasar tertentu (misalnya tahun 2010 atau 2015) untuk menggambarkan pendapatan riil per kapita tanpa memperhitungkan perubahan harga.', 'PDRBperKapitaADHK=PDRBADHK/JumlahPenduduk', 'PDRB per Kapita ADHK mencerminkan perubahan kesejahteraan ekonomi masyarakat secara riil. Kenaikan indikator ini menunjukkan adanya peningkatan pendapatan riil per penduduk di wilayah tersebut dari waktu ke waktu.', NULL, NULL, NULL, NULL, '2025-10-09 02:38:18', '2025-10-09 02:38:18'),
('709d0b7b-56c5-426a-af01-32b8973530b7', '6c3ecbe6-ee4f-4a8b-bbea-2b40e4afe391', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Indeks Kedalaman Kemiskinan (P1) mengukur seberapa jauh rata-rata pengeluaran penduduk miskin berada di bawah garis kemiskinan, mencerminkan tingkat keparahan ekonomi di kalangan penduduk miskin.', 'Metode perhitungannya dilakukan dengan menghitung rata-rata selisih antara garis kemiskinan dan pengeluaran penduduk miskin, dinormalisasi terhadap garis kemiskinan. Perhitungannya menggunakan metode Foster-Greer-Thorbecke (FGT).', 'Semakin tinggi nilai P1, semakin dalam tingkat kemiskinan, karena penduduk miskin semakin jauh dari garis kemiskinan.', NULL, NULL, NULL, NULL, '2025-10-09 03:03:17', '2025-10-09 03:03:17'),
('73b2bdaf-f1ee-4a40-b500-bf88f319ee28', '47afd60f-f195-4930-a5c0-c7d61b0d24fe', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Konsep ini mengacu pada definisi standar BPS yang telah disesuaikan dengan kondisi lokal Kabupaten Bungo. Indikator ini mengukur aspek fundamental dari pembangunan daerah.', 'Data dikumpulkan melalui survei penduduk dan registrasi administrasi kependudukan dengan menggunakan metodologi standar BPS yang telah disesuaikan dengan karakteristik wilayah.', 'Interpretasi: Pengeluaran Perkapita Pertahun SP2010 pada periode terkini menunjukkan tren positif. Nilai ini mencerminkan kondisi yang baik dalam kategori Indeks Pembangunan di Kabupaten Bungo. Peningkatan dari periode sebelumnya menunjukkan adanya perbaikan yang konsisten.', NULL, NULL, NULL, NULL, '2025-10-05 16:10:13', '2025-10-05 16:10:13'),
('8702e9d2-a56c-4ca8-8404-e74478d1b50e', '24eac8e7-f0c0-4149-9b9c-7769e5256885', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Konsep ini mengacu pada definisi standar BPS yang telah disesuaikan dengan kondisi lokal Kabupaten Bungo. Indikator ini mengukur aspek fundamental dari pembangunan daerah.', 'Data dikumpulkan melalui survei penduduk dan registrasi administrasi kependudukan dengan menggunakan metodologi standar BPS yang telah disesuaikan dengan karakteristik wilayah.', 'Interpretasi: IPG SP2020LF pada periode terkini menunjukkan tren positif. Nilai ini mencerminkan kondisi yang baik dalam kategori Gender di Kabupaten Bungo. Peningkatan dari periode sebelumnya menunjukkan adanya perbaikan yang konsisten.', NULL, NULL, NULL, NULL, '2025-10-05 16:13:16', '2025-10-05 16:13:16'),
('87dd2186-549a-498b-afc1-af85bda940e9', 'eb8442fe-13c2-483f-b941-cf7f72871deb', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Jumlah penduduk bekerja adalah banyaknya penduduk berusia 15 tahun ke atas yang melakukan pekerjaan minimal satu jam dalam seminggu terakhir untuk memperoleh penghasilan, baik sebagai pekerja penuh, pekerja keluarga, maupun pekerja bebas.', 'Metode perhitungannya didasarkan pada hasil Survei Angkatan Kerja Nasional (SAKERNAS) dengan menghitung seluruh individu usia kerja yang tergolong bekerja sesuai kriteria BPS.', 'umlah penduduk bekerja mencerminkan tingkat penyerapan tenaga kerja di suatu wilayah. Peningkatan jumlah penduduk bekerja menunjukkan kondisi pasar tenaga kerja yang semakin baik dan produktif.', NULL, NULL, NULL, NULL, '2025-10-09 02:54:04', '2025-10-09 02:54:04'),
('893f9850-7fc3-4644-9579-d7dbbb8b311a', 'ac35d74c-d7ab-4062-8dfa-af15e158930c', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Produk Domestik Regional Bruto Atas Dasar Harga Konstan (PDRB ADHK) merupakan nilai total barang dan jasa akhir yang dihasilkan oleh seluruh unit produksi di wilayah Kabupaten Bungo pada tahun berjalan yang dihitung menggunakan harga pada tahun dasar tertentu, sehingga mencerminkan perubahan volume produksi tanpa terpengaruh inflasi.', 'PDRB ADHK diperoleh dengan menilai seluruh komponen PDRB berdasarkan harga pada tahun dasar (misalnya tahun 2010 atau 2015), menggunakan metode deflasi atau revaluasi terhadap data PDRB ADHB agar mencerminkan perubahan riil dalam output.', 'Nilai PDRB ADHK menggambarkan pertumbuhan ekonomi riil di Kabupaten Bungo dari waktu ke waktu. Kenaikan nilai PDRB ADHK menunjukkan adanya peningkatan produksi barang dan jasa secara nyata, bukan akibat perubahan harga.', NULL, NULL, NULL, NULL, '2025-10-09 02:32:38', '2025-10-09 02:32:38'),
('89e35209-fd2d-42ee-8bc9-b53c0717c006', 'f115a13a-5e70-4479-8e4f-1a35471453e6', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Tingkat kemiskinan atau headcount index (P0) adalah proporsi penduduk yang memiliki pengeluaran per kapita di bawah garis kemiskinan dibandingkan dengan total penduduk.', 'Metode perhitungannya dilakukan dengan membagi jumlah penduduk miskin dengan total penduduk, kemudian dikalikan 100 persen.', 'Tingkat kemiskinan menunjukkan seberapa besar proporsi penduduk miskin dalam populasi. Nilai yang lebih rendah menandakan peningkatan kesejahteraan masyarakat.', NULL, NULL, NULL, NULL, '2025-10-09 03:02:13', '2025-10-09 03:02:13'),
('8e038e66-3204-4a8e-b50b-e5f619bc356f', 'd82df91a-ee08-4d30-9fb2-b566bed08956', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Indeks Keparahan Kemiskinan (P2) menggambarkan variasi pengeluaran di antara penduduk miskin, yang menunjukkan ketimpangan di kelompok masyarakat miskin.', 'Metode perhitungannya dilakukan dengan memperhitungkan kuadrat selisih antara garis kemiskinan dan pengeluaran penduduk miskin terhadap garis kemiskinan, menggunakan pendekatan Foster-Greer-Thorbecke (FGT).', 'Semakin besar nilai P2, semakin tinggi ketimpangan di antara penduduk miskin, menunjukkan sebagian penduduk miskin berada jauh di bawah garis kemiskinan.', NULL, NULL, NULL, NULL, '2025-10-09 03:03:59', '2025-10-09 03:03:59'),
('9c9f05ad-22f6-434a-839e-02ca660f9f95', '98e7e7de-5de2-480b-9c20-2fe9cec25554', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', NULL, 'PDRBperKapitaADHB= PDRBADHB/JumlahPenduduk\ndengan PDRB ADHB diukur berdasarkan harga berlaku pada tahun bersangkutan.', 'PDRB per Kapita ADHB menunjukkan rata-rata nilai barang dan jasa yang dihasilkan per penduduk dalam satu tahun. Kenaikan indikator ini dapat mencerminkan peningkatan kesejahteraan nominal masyarakat, namun belum memperhitungkan pengaruh inflasi atau distribusi pendapatan.', NULL, NULL, NULL, NULL, '2025-10-09 02:36:55', '2025-10-09 02:36:55'),
('a626c968-0939-430c-b037-224eb910d248', '08d04338-8c03-4d41-ba59-cb34504a0a16', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Tingkat Partisipasi Angkatan Kerja (TPAK) menunjukkan proporsi penduduk usia 15 tahun ke atas yang bekerja atau mencari pekerjaan terhadap total penduduk usia kerja di wilayah Kabupaten Bungo.', 'Metode perhitungannya dilakukan dengan membagi jumlah angkatan kerja dengan jumlah penduduk usia kerja, kemudian dikalikan 100 persen.', 'TPAK mencerminkan tingkat keterlibatan penduduk usia kerja dalam pasar tenaga kerja. Semakin tinggi TPAK, semakin besar proporsi penduduk yang aktif secara ekonomi.', NULL, NULL, NULL, NULL, '2025-10-09 02:57:45', '2025-10-09 02:57:45'),
('cb193696-742b-4b7b-8933-b9c75fd0f627', '17278526-a456-403f-a49b-63c97d50fa1d', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Jumlah pengangguran adalah banyaknya penduduk berusia 15 tahun ke atas yang sedang tidak bekerja, sedang mencari pekerjaan, atau sedang mempersiapkan usaha baru pada waktu pencacahan berlangsung.', 'Metode perhitungannya dilakukan dengan menghitung selisih antara jumlah angkatan kerja dan jumlah penduduk bekerja berdasarkan data Survei Angkatan Kerja Nasional (SAKERNAS).', 'Jumlah pengangguran mencerminkan tingkat tekanan dalam pasar tenaga kerja. Kenaikan jumlah pengangguran menunjukkan berkurangnya peluang kerja, sedangkan penurunan menunjukkan peningkatan penyerapan tenaga kerja di wilayah tersebut.', NULL, NULL, NULL, NULL, '2025-10-09 02:54:47', '2025-10-09 02:54:47'),
('cf618f46-d6e6-4048-bc3d-ad2e35935811', '8f24c524-9ad5-47eb-93ff-121a9aa9790d', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Konsep ini mengacu pada definisi standar BPS yang telah disesuaikan dengan kondisi lokal Kabupaten Bungo. Indikator ini mengukur aspek fundamental dari pembangunan daerah.', 'Data dikumpulkan melalui survei penduduk dan registrasi administrasi kependudukan dengan menggunakan metodologi standar BPS yang telah disesuaikan dengan karakteristik wilayah.', 'Interpretasi: IPM SP2020LF pada periode terkini menunjukkan tren positif. Nilai ini mencerminkan kondisi yang baik dalam kategori Indeks Pembangunan di Kabupaten Bungo. Peningkatan dari periode sebelumnya menunjukkan adanya perbaikan yang konsisten.', NULL, NULL, NULL, NULL, '2025-10-05 16:02:00', '2025-10-05 16:02:00'),
('d2199b18-839a-4615-ac33-be7b041dda66', '61ba184d-be21-44cf-b005-9d21e3fa62ad', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Konsep ini mengacu pada definisi standar BPS yang telah disesuaikan dengan kondisi lokal Kabupaten Bungo. Indikator ini mengukur aspek fundamental dari pembangunan daerah.', 'Data dikumpulkan melalui survei penduduk dan registrasi administrasi kependudukan dengan menggunakan metodologi standar BPS yang telah disesuaikan dengan karakteristik wilayah.', 'Interpretasi: IPM SP2010 pada periode terkini menunjukkan tren positif. Nilai ini mencerminkan kondisi yang baik dalam kategori Indeks Pembangunan di Kabupaten Bungo. Peningkatan dari periode sebelumnya menunjukkan adanya perbaikan yang konsisten.', NULL, NULL, NULL, NULL, '2025-10-05 14:10:58', '2025-10-05 15:58:54'),
('de4d5fc0-67e7-4fb2-8fdf-3c82429716c0', '2fb4a5ae-4307-4c9d-a8f5-7949efe9023f', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Pertumbuhan PDRB per Kapita ADHK adalah tingkat perubahan PDRB per kapita atas dasar harga konstan dari tahun sebelumnya ke tahun berjalan, yang mencerminkan peningkatan kesejahteraan ekonomi masyarakat secara riil tanpa terpengaruh perubahan harga.', 'Metode perhitungannya dilakukan dengan membandingkan nilai PDRB per kapita ADHK pada tahun berjalan dengan nilai pada tahun sebelumnya, kemudian hasil selisihnya dibagi dengan nilai tahun sebelumnya dan dikalikan 100 persen untuk memperoleh laju pertumbuhan dalam persen.', 'Pertumbuhan PDRB per Kapita ADHK yang positif menunjukkan adanya peningkatan pendapatan riil rata-rata penduduk, sedangkan nilai negatif menunjukkan penurunan kesejahteraan ekonomi secara riil dibandingkan tahun sebelumnya.', NULL, NULL, NULL, NULL, '2025-10-09 02:41:14', '2025-10-09 02:41:14'),
('e0ba43ae-8290-4412-a243-e353390c4cfc', '0e428f5f-ce75-47a1-af88-a662df25f577', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Jumlah bukan angkatan kerja adalah banyaknya penduduk berusia 15 tahun ke atas yang tidak bekerja dan tidak aktif mencari pekerjaan, seperti pelajar, mahasiswa, ibu rumah tangga, serta mereka yang tidak mampu atau tidak ingin bekerja.', 'Metode perhitungannya dilakukan dengan menghitung seluruh penduduk usia kerja yang tidak termasuk dalam kategori angkatan kerja (bekerja atau pengangguran), berdasarkan hasil Survei Angkatan Kerja Nasional (SAKERNAS).', 'Jumlah bukan angkatan kerja menggambarkan besarnya bagian populasi usia kerja yang tidak berpartisipasi dalam kegiatan ekonomi. Nilainya dapat dipengaruhi oleh faktor pendidikan, kondisi sosial, dan kesempatan kerja.', NULL, NULL, NULL, NULL, '2025-10-09 02:56:57', '2025-10-09 02:56:57'),
('e2bf8ad5-b07b-4399-940d-4e91a172992b', '280c20e4-d6e3-46e8-ba24-d62020b95914', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2025-10-09 16:17:18', '2025-10-10 02:29:41'),
('e8789638-a48f-49b5-b1a6-64848b9a11b5', '34999b34-5e23-4d86-ba10-d1d34034e13e', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Konsep ini mengacu pada definisi standar BPS yang telah disesuaikan dengan kondisi lokal Kabupaten Bungo. Indikator ini mengukur aspek fundamental dari pembangunan daerah.', 'Data dikumpulkan melalui survei penduduk dan registrasi administrasi kependudukan dengan menggunakan metodologi standar BPS yang telah disesuaikan dengan karakteristik wilayah.', 'Interpretasi: Indeks Pemberdayaan Gender (IDG) pada periode terkini menunjukkan tren positif. Nilai ini mencerminkan kondisi yang baik dalam kategori Gender di Kabupaten Bungo. Peningkatan dari periode sebelumnya menunjukkan adanya perbaikan yang konsisten.', NULL, NULL, NULL, NULL, '2025-10-05 16:11:29', '2025-10-05 16:11:29'),
('f0fc3502-9430-4f87-b416-7a3a648f7e7b', 'ef4991fb-f4ec-43e1-8233-e73774b15e75', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Garis kemiskinan adalah nilai pengeluaran minimum yang diperlukan seseorang untuk memenuhi kebutuhan dasar hidup layak, meliputi kebutuhan makanan yang setara dengan 2.100 kalori per kapita per hari dan kebutuhan nonmakanan seperti perumahan, pendidikan, serta kesehatan.', 'Metode perhitungannya dilakukan dengan menjumlahkan Garis Kemiskinan Makanan (GKM) dan Garis Kemiskinan Nonmakanan (GKNM), yang diperoleh dari hasil Survei Sosial Ekonomi Nasional (Susenas).', 'Penduduk dengan pengeluaran per kapita per bulan di bawah garis kemiskinan dikategorikan sebagai penduduk miskin. Kenaikan garis kemiskinan menunjukkan meningkatnya biaya kebutuhan dasar di wilayah tersebut.', NULL, NULL, NULL, NULL, '2025-10-09 02:59:43', '2025-10-09 03:01:05'),
('f860a885-84af-4b1b-ad49-7ea4127b387b', '518770e0-bdf7-419a-9364-e3c825a755c6', 'Kabupaten', 'Kabupaten Bungo', 'Tahunan', 'Tahunan', 'Pertumbuhan ekonomi adalah tingkat perubahan PDRB Atas Dasar Harga Konstan (ADHK) dari tahun ke tahun yang menunjukkan sejauh mana output barang dan jasa suatu wilayah meningkat secara riil tanpa dipengaruhi oleh perubahan harga.', 'Pertumbuhan ekonomi dihitung dengan rumus:\nPE = ((PDRB ADHK_t  - PDRB ADHK_t-1)/PDRB ADHK_t-1)x100%\ndi mana  t adalah tahun berjalan dan  t1 adalah tahun sebelumnya.', 'Nilai pertumbuhan ekonomi yang positif menunjukkan peningkatan produksi dan aktivitas ekonomi di wilayah tersebut, sedangkan nilai negatif menunjukkan adanya penurunan kinerja ekonomi dibandingkan tahun sebelumnya.', NULL, NULL, NULL, NULL, '2025-10-09 02:35:25', '2025-10-09 02:35:25');
